UPDATE `quest_template` SET `QuestDescription`='<Once again, Reshad''s voice envelops you.>\n\nTerokk was a powerful and respected king, beloved by his people.\n\nHis sages, however, were not so loyal. Hungry for control of Skyreach, they conspired against him.', `VerifiedBuild`=20253 WHERE `Id`=35895; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='My long sleep was disturbed by dreams of the past. I cut down my old enemies again. I watched my daughter die again.\n\nYou were there. I felt your presence in these dreams. And your past was revealed to me as well.\n\nSomeone has woven our fates together. My people are yours to protect, and your enemies are mine to destroy.\n\nThe Shattered Hand are rallied in Bladefist Hold. Left to their own, they would claim this land for the Iron Horde.\n\nTake my power, and together we shall break them.', `VerifiedBuild`=20253 WHERE `Id`=35896; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Terokk''s daughter Lithic was a skilled huntress, but found her true passion in goldsmithing.\n\nShe forged this bangle as a gift for her father, and he wore it for many years. Only after Lithic passed away did he remove the bangle, for her memory was too much for the old king to bear.\n\nPlace the bangle upon the effigy, and I shall tell you of Terokk''s fall.', `VerifiedBuild`=20253 WHERE `Id`=35897; -- -Unknown-
