UPDATE `quest_template` SET `QuestDescription`='A powerful enchantment emanates from these ancient Highmaul bracers.\n\nMaybe Yu''rina the Mystic, your garrison enchanting quartermaster, can tell you more about the bracer.', `VerifiedBuild`=20253 WHERE `Id`=36255; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Oru''kai was the first ogre mage to master the art of enchanting. Upon his death, his items were scattered across Draenor. I have tracked his scepter to the field you see before us. \n\nAs you can see, the scepter''s enchantment is making it difficult to retrieve. A would-be apprentice, Torag Stonefury, took one of Oru''kai''s rings in to break the enchantment, but he failed and became trapped in ice. \n\nFree Torag, take the ring, and complete his task, and I will consider a reward.', `VerifiedBuild`=20253 WHERE `Id`=36257; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If I had known being an enchanter was this dangerous, I would have stayed in Wor''gol. \n\nHere, take this ring. The bird man told me to use the ring on the scepter to nullify the enchantment.\n\nBring the scepter back to him and maybe he will teach you what he promised to teach me.', `VerifiedBuild`=20253 WHERE `Id`=36260; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='A powerful enchantment emanates from these ancient Highmaul bracers.\n\nMaybe Eileese Shadowsong, your garrison enchanting quartermaster, can tell you more about the bracer.', `VerifiedBuild`=20253 WHERE `Id`=36308; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Oru''kai was the first ogre mage to master the art of enchanting on Draenor. Upon his death, his items were scattered across Draenor. I have tracked his staff to the shore you see before us. \n\nAs you can see, the staff''s enchantment is making it difficult to retrieve. A would-be apprentice, Deema, took one of Oru''kai''s rings in to break the enchantment, but she failed and became trapped as well. \n\nFind and free Deema, take the ring, complete her task, and I will consider a reward.', `VerifiedBuild`=20253 WHERE `Id`=36313; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If I had known being an enchanter was this dangerous, I would have stayed in Shattrath. \n\nHere, take this ring. The arakkoa told me to use the ring on the staff to nullify the enchantment.\n\nBring the scepter back to him and maybe he will teach you what he promised to teach me.', `VerifiedBuild`=20253 WHERE `Id`=36315; -- -Unknown-
