UPDATE `quest_template` SET `QuestDescription`='All o'' them mole machines got mighty unreliable here in Gorgrond. I hear tell that one of ''em might''ve crashed here in Tangleheart.\n\nSee if you can find Frenna. She would''ve been on the one we tracked to this location. I''ll go lookin'' for the mole machine to see if it can be repaired.', `VerifiedBuild`=20253 WHERE `Id`=36368; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=5000, `VerifiedBuild`=20253 WHERE `Id` IN (554 /*Stormpike's Deciphering*/, 2870 /*Against Lord Shalzaru*/);
UPDATE `quest_template` SET `RewardMoney`=3500, `VerifiedBuild`=20253 WHERE `Id`=557; -- Bracers of Binding
UPDATE `quest_template` SET `QuestDescription`='<Durotan looks at you curiously.>\n\nThose from your world are not much for subtlety, are they?\n\nGo on ahead and greet our new companion. We will join you as soon as we can make ready.', `VerifiedBuild`=20253 WHERE `Id`=36434; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='So, get this.\n\nAs I was flyin'' in, I took the opportunity to scope out what might be a defensible position.\n\nJust on the other side o'' these boulders is an ideal clearing to hole up in. I even brought a set of blueprints to get us all settled in!\n\nThat''s not too presumptuous, is it?\n\nAnyway, whenever you''re ready just hit this plunger!', `VerifiedBuild`=20253 WHERE `Id`=36460; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Hey there, peach. We''ve got the lumber mill good and ready, but we gotta find a way of choppin'' wood fast out here.\n\nThe Laughing Skull talked about Tangleheart, where the botani grow things quick as a quark.\n\nI''m headin'' there now.', `VerifiedBuild`=20253 WHERE `Id` IN (36497 /*-Unknown-*/, 36572 /*-Unknown-*/, 35707 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=33555378, `VerifiedBuild`=20253 WHERE `Id` IN (728 /*To the Undercity for Yagyin's Digest*/, 2203 /*Badlands Reagent Run II*/);
UPDATE `quest_template` SET `QuestDescription`='Ya know boss, I think I know how we can take this place to the next level. Bigger walls. More buildings. Some space to stretch your arms after a long day of adventuring.\n\nDon''t get me wrong, it''s going to take a lot of resources, but what else are these things for?\n\nWe can plot it out on the drafting table whenever you''re ready. It''s going to be GLORIOUS.', `VerifiedBuild`=20253 WHERE `Id`=36567; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Commander, I''ve been working on schematics that you might be interested in.\n\nWhat do you think about pushing out the walls and making room to get some additional structures in here? Our forces have been growing, and things are getting a little cramped, and I''d really like us to put some of those additional blueprints to use.\n\nIf you could, take a look at the plans on the table here. As soon as I have your go ahead, I''ll get everyone to work immediately.', `VerifiedBuild`=20253 WHERE `Id`=36592; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='One of your soldiers stopped by asking for you while you were out. Something about a caravan heading out to Nagrand.\n\nWhatever it was, it can''t have gone well for them. That''s Warsong territory.', `VerifiedBuild`=20253 WHERE `Id` IN (36601 /*-Unknown-*/, 36602 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Welcome back, $gsir:mam;.\n\nOne of Bodrick''s men delivered a message about a caravan being dispatched for Nagrand. He''s awaiting your approval on a new outpost.\n\nI''ve been hearing whispers around camp about Nagrand. They say it''s Warsong territory. They might need your help $gsir:mam;.', `VerifiedBuild`=20253 WHERE `Id`=36606; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Welcome back, $gsir:mam;.\n\nOne of our shadow hunters delivered a message about a caravan being dispatched for Nagrand. Rokhan''s awaiting your approval on a new outpost.\n\nI''ve been hearing whispers around camp about Nagrand. They say it''s Warsong territory. They might need your help $gsir:mam;.', `VerifiedBuild`=20253 WHERE `Id`=36607; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Now that you have proof, we might just have a shot at convincing Nat Pagle to join us out here.\n\nLast I heard, he was in fishing with the local Angler''s faction out in Pandaria.  Somewhere off the coast of  Krasarang Wilds.  Head out there, show him your catch and see if you can get him to come back with you!', `VerifiedBuild`=20253 WHERE `Id`=36608; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='What''s this species, a molten catfish you say? I have never even heard of a fish like this, much less seen one in person!\n\nI have to find more fish like this, it''s what I live for! And if the fishing is as good as you say it is, there is just no way I can pass this opportunity up.  Take this page from my journal as proof that you found me and I will meet you back at your Garrison.', `VerifiedBuild`=20253 WHERE `Id`=36609; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If you want me to help you permanently, you have to show me a few of these big Draenor catches first.  Head out into the wild and bring me back the biggest fish you can find from all the surrounding areas.\n\nI made this custom lure for you to use, please take care of it, it''s never let me down!', `VerifiedBuild`=20253 WHERE `Id`=36611; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Now that you are experienced enough with Draenor fishing, we might have a shot at convincing Nat Pagle to join us out here.\n\nIf we want Nat to actually come all the way out here, we are going to have to show him real proof of the incredible catches on Draenor.  Head out to the lava lakes here in Frostfire and see what you can do.  All that time you spend honing your skill here in Draenor should pay off now.', `VerifiedBuild`=20253 WHERE `Id`=36612; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Boss! Guess what?! I finally got that new larger draft paper in that I ordered when we first came here. And ya know what larger draft paper means?\n\nIt means I can draw a bigger fortress!\n\nAnd if I can draw it, I can certainly make it! Making''s the easy part, as long as you''ve got a few thousand stones and logs lying around.\n\nSo whada''ya say, boss? Shall we get building?', `VerifiedBuild`=20253 WHERE `Id`=36614; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Commander! Some good news. I finally got that new larger draft paper in that I ordered when we first came here. And do you know what larger draft paper means?\n\nIt means I can draw a bigger castle!\n\nAnd if I can draw it, we can certainly make it! Making it is the easy part, assuming you have a few thousand stones and logs lying around.\n\nSo what do you say, sir? Shall we get building?', `VerifiedBuild`=20253 WHERE `Id`=36615; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You truly are a master fisherman!\n\nI would be delighted to join you here on Draenor and help you catch as many lunkers as you can. But first, let''s grab a drink.', `VerifiedBuild`=20253 WHERE `Id`=36616; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Good to see you, commander.\n\nMy network has been keeping eyes on enemy movements. There are a couple threats I''d like to get you up to date on.\n\nDo you have a moment to look at our options?', `VerifiedBuild`=20253 WHERE `Id`=36620; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Bloodmaul ogres from Frostfire Ridge have been ambushing trade routes throughout the continent, and are putting captured soldiers to work in their slag mines.\n\nBodrick Grey has requested the rescue of friendly troops that have been taken prisoner in the main Bloodmaul compound at Stonefury Cliffs.', `VerifiedBuild`=20253 WHERE `Id` IN (36648 /*-Unknown-*/, 38189 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Shattrath City is in the hands of Sargerei forces under the leadership of the traitor Exarch, Socrethar.\n\nMembers of the Sha''tari Defense have been requesting aid against the Shadow Council forces in the eastern portions of the city.', `VerifiedBuild`=20253 WHERE `Id` IN (36649 /*-Unknown-*/, 38201 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Shattrath City is in the hands of Sargerei forces under the leadership of the once Exarch, Socrethar.\n\nThe Shadow Council forces in the eastern portion of the city are gaining in power through the aid of demons from the Nether, and need to be culled before they become a threat to all of our operations.', `VerifiedBuild`=20253 WHERE `Id` IN (36667 /*-Unknown-*/, 38187 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Bloodmaul ogres from Frostfire Ridge have been ambushing trade routes throughout the continent, and are putting captured soldiers to work in their slag mines.\n\nShadow Hunter Rokhan has requested the rescue of friendly troops that have been taken prisoner in the main Bloodmaul compound at Stonefury Cliffs.', `VerifiedBuild`=20253 WHERE `Id` IN (36669 /*-Unknown-*/, 38176 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Iron Horde war machines are being shipped onto battlefields by the dozens, and our forces are struggling to hold their ground. Most of these machines seem to be originating from the Iron Siegeworks in eastern Frostfire Ridge.\n\nA strategic attack to disrupt and dismantle the Iron Horde at the siegeworks could be just what we need to turn the tide of the war.', `VerifiedBuild`=20253 WHERE `Id` IN (36674 /*-Unknown-*/, 36696 /*-Unknown-*/, 38178 /*-Unknown-*/, 38191 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Colossal magnaron, gronn, and other stone monstrosities have been threatening our outposts in the west. Most seem to originate from Magnarok in Frostfire Ridge.\n\nIf we strike at them at their home, we should be able to force them back. It''s risky, but it may be our best move. While you''re there, see if you can recover any of our supplies.', `VerifiedBuild`=20253 WHERE `Id` IN (36675 /*-Unknown-*/, 38190 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Botani and the plant monstrosities they conjure have been slowly encroaching on our outposts in the north. For every plant we kill, new ones seem to rise in its place.\n\nBodrick Grey has put together a plan for striking at the heart of their lands, in Everbloom Wilds. He thinks this will draw them back into the wilds of Gorgrond, giving us more room to maneuver around them.', `VerifiedBuild`=20253 WHERE `Id` IN (36676 /*-Unknown-*/, 38192 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Massive ogron have been battering our frontlines, and no matter how many we down, there seem to be more to replace them.\n\nMost of these ogron appear to be coming from the Broken Precipice, deep in western Nagrand. If we''re to stand a chance in the coming battles, we need to find a way to remove these ogron from the battlefield.', `VerifiedBuild`=20253 WHERE `Id` IN (36677 /*-Unknown-*/, 36694 /*-Unknown-*/, 38180 /*-Unknown-*/, 38193 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Warsong raiders out of Mok''gol Watchpost have been terrorizing anything and everything not behind a tall wall. We''ve warned travelers not to stray out alone, but many don''t listen.\n\nIf we were to launch an assault on Mok''gol Watchpost, we would almost certainly put the Warsong back on the defensive, restricting most of their riders to Nagrand.', `VerifiedBuild`=20253 WHERE `Id` IN (36678 /*-Unknown-*/, 36693 /*-Unknown-*/, 38181 /*-Unknown-*/, 38195 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='There''s been a resurgence of rylaks on the battlefield in our skirmishes against the Iron Horde. If we don''t stop them at the source, we''ll quickly lose control of the roads and be pushed back into our outposts.\n\nThe most likely source of these additional rylaks is in southeastern Shadowmoon Valley, at Darktide Roost. If we move quickly, we should still have time to get ahead of the problem.', `VerifiedBuild`=20253 WHERE `Id` IN (36679 /*-Unknown-*/, 38196 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Recent reports suggest a notable rise of activity by Sargerei forces at Socrethar''s Rise in southern Shadowmoon Valley.\n\nSocrathar''s disciples pose a threat to draenei and our garrison alike. We need to quell them at our soonest convenience.', `VerifiedBuild`=20253 WHERE `Id` IN (36680 /*-Unknown-*/, 38197 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Some of our best scouts have gone missing in the vicinity of the lost ruins of Veil Anzu.\n\nBodrick Grey has requested any available resources be dispatched to identify the threat and see if any of our men yet remain alive within the ruins.', `VerifiedBuild`=20253 WHERE `Id` IN (36681 /*-Unknown-*/, 38198 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Remnants of the Shadowmoon clan continue to operate out of the peaks on the eastern border of Spires of Arak.\n\nBodrick Grey is concerned at their proximity to the garrison, and has put out a request that we thin their forces as soon as possible.', `VerifiedBuild`=20253 WHERE `Id` IN (36682 /*-Unknown-*/, 38199 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='We''ve been receiving regular reports of birdmen from the south ambushing and burning caravans along the main roads.\n\nGuards from our outposts are requesting that we launch a counter attack against the main presence of Adherents of Rukhmar at Skettis in Spires of Arak.', `VerifiedBuild`=20253 WHERE `Id` IN (36683 /*-Unknown-*/, 36688 /*-Unknown-*/, 38186 /*-Unknown-*/, 38200 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='As we do battle all across Draenor, the cowardly Horde try to seize our territory within Ashran.\n\nOur men would be inspired to see you join the battlefield, striking terror into the hearts of the Horde.', `VerifiedBuild`=20253 WHERE `Id`=36684; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Sargerei forces from deep in Shattrath have grown stronger and bolder by the day. We can no longer risk ignoring the threat that they pose.\n\nBring allies if you wish to face the Sargerei so deep within the city.', `VerifiedBuild`=20253 WHERE `Id` IN (36685 /*-Unknown-*/, 36699 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Blackrock forces based out of the Pit in Gorgrond make up the bulk of the Iron Horde army. If we crush them on their home soil, the rest of the Iron Horde will have little hope of standing against us.\n\nIf you choose the battle, bring friends. The Blackrock won''t be defeated easily.', `VerifiedBuild`=20253 WHERE `Id` IN (36686 /*-Unknown-*/, 36701 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='A challenge has been issued at the Ring of Blood.\n\nBring friends and do battle to prove your right as champion.', `VerifiedBuild`=20253 WHERE `Id` IN (36687 /*-Unknown-*/, 36700 /*-Unknown-*/);
