UPDATE `quest_template` SET `QuestDescription`='I assume you''re familiar with the arakkoa, commander? Great, flying birdfolk. Extremely territorial.\n\nSome, however, have withered wings - a disease, maybe. They seem to be outcast from arakkoa society. You find them now and then, squatting in forgotten ruins or peddling trinkets on the roadside.\n\nIt seems the Iron Horde has incited the arakkoa by moving into their lands, and the outcasts are fleeing in droves.\n\nWe should make contact with these outcasts - they could have valuable information.', `VerifiedBuild`=20253 WHERE `Id` IN (36951 /*-Unknown-*/, 34653 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='**Eyes Only -- Commander $n**\n\nDurotan recommended dat we be gettin'' a foothold in Nagrand, so I taken the liberty of dispatchin'' some of da boys.\n\nThrall''s already reportin'' the new outpost be nearly complete. He been askin'' me to let ya know they be ready for ya.\n\nA windrider be waitin'' to catch ya up with the latest caravan shipment whenever you be ready, $g sir:ma''am;.\n\n-- Rokhan', `VerifiedBuild`=20253 WHERE `Id`=36952; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='**Eyes Only -- Commander $n**\n\nThe Iron Horde have proved themselves worthy foes.$B$BThey managed to get their fleet moving to Talador from Gorgrond without my spies seeing a thing. Talador be a crossroads for the whole continent. We can''t let them have it.$B$BDon''t worry boss, we got a plan. Foreman Grobash be setting up an outpost for our forces as we speak. They be ready for you when you arrive, commander.$b$b--Rokhan', `VerifiedBuild`=20253 WHERE `Id`=36953; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=13000, `RewardMoneyDifficulty`=6, `RewardBonusMoney`=0, `AllowableRaces`=-1, `VerifiedBuild`=20253 WHERE `Id`=1139; -- The Lost Tablets of Will
UPDATE `quest_template` SET `QuestDescription`='At the armory, we can take scraps of Iron Horde armor that you collect and turn them into new gear. It''s not the strongest stuff in the world, but it looks good.\n\nGet some Iron Horde scraps and come back my way. I''ll set you up with a nice tabard for your troubles.', `VerifiedBuild`=20253 WHERE `Id`=37043; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve got a lot goin'' on here at the workshop. We''re buildin'' new inventions all the time, and you can find ''em behind me on the workbench.\n\nGo ahead and grab today''s glorious invention. Use it at your own risk.', `VerifiedBuild`=20253 WHERE `Id`=37044; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Here at the Salvage Yard we inspect any extra material your followers bring back from the field, preserving anything that may be useful.\n\nI have an extra pack of material our people brought in that I''ve yet to go through. Why don''t you take it over to the incinerator and see if it contains anything useful?', `VerifiedBuild`=20253 WHERE `Id` IN (37045 /*-Unknown-*/, 37086 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Hey der mon, I be ya new headhunter. \nThe tavern be a perfect place for adventurers to rest after a long journey. It also be a great place to talk them into joining our cause.\n\nI be havin'' a few recruits for ya to look at, if ya find one we can hire then I''ll give ya a little somethin'' as a finder fee for ya time.', `VerifiedBuild`=20253 WHERE `Id`=37046; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='$GSir:Ma''am;, the storehouse is fully operational and I''ve seen to it that your supplies are safely stored away and accounted for.\n\nUnfortunately, during the rest of my audit I found that we are missing a few crates of surplus material - probably misplaced by one of the porters.\n\nIf you happen to come across any of the surplus crates while making your rounds, please bring them to me and I''ll update our ledger.', `VerifiedBuild`=20253 WHERE `Id` IN (37060 /*-Unknown-*/, 37087 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='To pass the time, traders have been known to consume beverages of an inspired nature, if you know what I mean.\n\nSometimes, they drink a bit too much. Your trader might have stumbled beyond the gates and passed out under a tree. It''s been known to happen from time to time.\n\nLuckily, I have a brew that I use to rouse groggy traders. One splash and I find they''re more willing to work.', `VerifiedBuild`=20253 WHERE `Id` IN (37062 /*-Unknown-*/, 37088 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The workshop is bustling with the whir of minds and motors. We''re coming up with new inventions all the time.\n\nTry out today''s glorious invention on the workbench behind me.', `VerifiedBuild`=20253 WHERE `Id`=37091; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='At the Dwarven Bunker, we can take scraps of Iron Horde armor that you collect and turn them into new gear. It''s not the strongest stuff in the world, but it looks good.\n\nGet some Iron Horde scraps and come back my way. I''ll set you up with a nice tabard for your troubles.', `VerifiedBuild`=20253 WHERE `Id`=37092; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The inn provides a perfect place for adventurers to take a rest between their travels. It''s also a great place to talk them into joining our cause over a few rounds of drinks.\n\nGo through my selection and let''s see if we can obtain a new recruit. I''ll give you a little something as a finder''s fee for your efforts.', `VerifiedBuild`=20253 WHERE `Id`=37119; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='$p, you have done much for my people. I wish to thank you on their behalf.\n\nPlease visit Veil Terokk when you can.', `VerifiedBuild`=20253 WHERE `Id`=37177; -- -Unknown-
