UPDATE `quest_template` SET `QuestDescription`='The ogres at the Gorian Proving Grounds are rousing champions to turn against our forces in Nagrand.\n\nA decisive assault on their training grounds should prevent them from mustering the forces they need to stand against us, and will help remind them that we are not an enemy they want to make.', `VerifiedBuild`=20253 WHERE `Id` IN (37523 /*-Unknown-*/, 38194 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The ogres at the Gorian Proving Grounds be rousin'' champions to turn against our forces in Nagrand.\n\nA decisive assault on their training grounds should prevent dem from musterin'' the forces dey be needin'' to stand against us, and will help remind them that we are not an enemy they want to be makin''.', `VerifiedBuild`=20253 WHERE `Id` IN (37524 /*-Unknown-*/, 38202 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardBonusMoney`=146300, `VerifiedBuild`=20253 WHERE `Id` IN (1795 /*The Binding*/, 6064 /*Taming the Beast*/, 7602 /*Flawless Fel Essence*/, 7623 /*Lord Banehollow*/, 9464 /*Call of Fire*/, 9600 /*Redemption*/, 14170 /*The Grateful Dead*/);
UPDATE `quest_template` SET `RewardBonusMoney`=36600, `AllowableRaces`=33555378, `VerifiedBuild`=20253 WHERE `Id`=1801; -- Tome of the Cabal
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=2, `VerifiedBuild`=20253 WHERE `Id`=1859; -- Therzok
UPDATE `quest_template` SET `QuestDescription`='Yer garrison scouts report that blackrock miners dug up a magnaron, and that the filthy beast has begun helpin'' those brutes churn out their infernal machines. They call it "Kromog."\n\nTravel to Blackrock Foundry and slay that fiend!', `VerifiedBuild`=20253 WHERE `Id`=37770; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In Nagrand, the ogres tell of an ancient weapon called Gutrek''s cleaver. I would very much like to study it.\n\nA goblin treasure hunter by the name of Val Goldspade discovered the whereabouts of the weapon. Unfortunately, this goblin has gone missing somewhere in the Broken Precipice - probably after a run-in with the locals.', `VerifiedBuild`=20253 WHERE `Id`=37788; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The journal points to the location of the pieces of Gutrek''s Cleaver. It reads:\n\n"The pommel was brought to the Broken Precipice, where it was to be housed in the skull of Gutrek''s first kill. It looks like it was some manner of large beast that he fought in the big bone pit."', `VerifiedBuild`=20253 WHERE `Id`=37797; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The search for Gutrek''s Cleaver continues. The journal reads:\n\n"The hilt was to be buried in the marshlands, among the serpents whose poison claimed Gutrek''s life. There''s something here about covering it with a spiral stone, which is supposed to keep Gutrek''s spirit at bay somehow."', `VerifiedBuild`=20253 WHERE `Id`=37798; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Only one piece remains. The journal reads:\n\n"The final piece, Gutrek''s blade, was to be displayed in a place of honor for all time overlooking the Ring of Blood. I don''t think I''ve seen it there myself, but it says it''s supposed to be somewhere where it has a clear view of every battle."', `VerifiedBuild`=20253 WHERE `Id`=37799; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='With the pieces recovered, all that is left is to reforge Gutrek''s Cleaver. Goldspade''s journal seems to indicate that the only place to do this is the location where it was initially dismantled.\n\nThe journal mentions a "Spirit Forge" used to dismantle the blade, and that it may be located somewhere in the nearby gorge. Find the forge and use it to combine the pieces you''ve gathered.', `VerifiedBuild`=20253 WHERE `Id` IN (37811 /*-Unknown-*/, 37992 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='So this is your first race, eh? Don''t worry - it''s easier than it looks. Let me break it down for you...\n\nRun through that big  banner there. That starts everything. Then, follow the smaller banners until you see a big, blue Post. Hit that, then return here.\n\nYou''re scored on your time, so finish as fast as you can! And watch out for those electrified tripwires. They''ll slow you down if you run through them. Good luck!', `VerifiedBuild`=20253 WHERE `Id`=37819; -- -Unknown-
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=16, `VerifiedBuild`=20253 WHERE `Id` IN (1998 /*Fenwick Thatros*/, 1999 /*Tools of the Trade*/);
UPDATE `quest_template` SET `RewardXPDifficulty`=7, `RewardMoney`=462000, `RewardMoneyDifficulty`=7, `RewardBonusMoney`=219450, `RewardSpell`=186756, `Flags`=35651592, `FlagsEx`=65792, `RewardChoiceItemID1`=124634, `RewardChoiceItemID2`=124635, `RewardChoiceItemID3`=124636, `RewardChoiceItemID4`=124637, `RewardChoiceItemID5`=124638, `RewardChoiceItemQuantity1`=1, `RewardChoiceItemQuantity2`=1, `RewardChoiceItemQuantity3`=1, `RewardChoiceItemQuantity4`=1, `RewardChoiceItemQuantity5`=1, `AllowableRaces`=33555378, `LogDescription`='Speak with Drek''Thar at the Throne of the Elements in Nagrand.', `QuestDescription`='You''ve done everything I''ve asked, $n. I believe we can apply one final enchantment to your ring. But... we must be cautious. Last time I augmented your ring I killed you. (Sorry.) It will take an act of ancient magic to empower you further.$b$bFortunately, you''ve made some powerful allies during your time here. Seek out Farseer Drek''Thar at the Throne of Elements in Nagrand. There you can receive the blessing of the elements and safely unlock your ring''s final form. Go, hero! Claim your reward!', `QuestCompletionLog`='Speak with Khadgar.', `VerifiedBuild`=20253 WHERE `Id`=37840; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It seems the Adherents of Rukhmar have stumbled upon some information leading to an ancient amulet, said to possess the power of their god and bestow it upon the wearer. We should make sure they don''t find it.\n\nHead to Skettis and find what they have learned. Hopefully we can find it before they get to it.', `VerifiedBuild`=20253 WHERE `Id`=37848; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Arakkoa research points to three "keys" that need to be activated in order to use the Apexis device. The first is located in Skettis. The text mentioning it reads:\n\n"The first key is kept in the high reaches of upper Skettis. It lay where the dead can protect it from the talons of the unwanted."', `VerifiedBuild`=20253 WHERE `Id`=37849; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The first point has been activated and two more remain. The second location is hinted at in the old outcast writing:\n\n"Beneath the third fall of the great Skettis river lay the second key. May the ever-rushing waters sweep away those that might seek it."', `VerifiedBuild`=20253 WHERE `Id`=37850; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='One last key is required to access the Apexis device. The writings pertaining to its location read:\n\n"The final key has been housed deep within the fungal caves where the river makes its final drop. Though the pale orcs that dwell there may be vile, they should prove a worthy deterrent."', `VerifiedBuild`=20253 WHERE `Id`=37851; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=1500022, `QuestDescription`='Now that the keys have been activated, the Apexis device that leads to the amulet should be accessible. \n\nThe Arakkoa research states that it is likely located in Lost Veil Anzu, within the "shrine to the raven god."', `VerifiedBuild`=20253 WHERE `Id`=37852; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You like this big race, do you? Me too!\n\nIt has four legs: get to the purple post, then green, then red, then back here.\n\nYour time matters, so do it fast!', `VerifiedBuild`=20253 WHERE `Id`=37868; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In Shadowmoon Valley there is a cave said to possess an ancient tome that may contain secrets that can help our cause against the Iron Horde. The cave, however, is protected by an ancient barrier composed of arcane energy.\n\nThere is a goblin in Darktide Roost, said to know how to take down any barrier. Persuade him to give up his secrets and bring back the book.', `VerifiedBuild`=20253 WHERE `Id`=37881; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You will need three ingredients to make Megacharge''s special "Arcane Bunker Buster," which should be able to take down the barrier. The first ingredient, some precision blasting powder, should be available nearby. The book reads:\n\n"To make one, you''ll first need to acquire some high grade, precision blasting powder. Here in Blackfuse Company, it''s pretty easy to come by, since they use it for all of the cannons."', `VerifiedBuild`=20253 WHERE `Id`=37882; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='With the blasting powder acquired, you now must find a suitable detonator. A note attached to the entry in the cookbook hints to where one might be found:\n\n"Reminder: Order more high-voltage detonators. The last shipment was lost off of the Shadowmoon coast near the demon-inhabited cliffs. Maybe we should send a diving team to salvage."', `VerifiedBuild`=20253 WHERE `Id`=37883; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The final ingredient to create Megacharge''s bomb is a sizable quantity of demon''s blood. \n\nUnfortunately, that''s not something they''re likely to give up easily...', `VerifiedBuild`=20253 WHERE `Id`=37884; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The components have been gathered and the "Arcane Bunker Buster" is assembled. Hopefully, this should pack enough punch to take out the barrier.\n\nThere''s only one way to find out...', `VerifiedBuild`=20253 WHERE `Id` IN (37885 /*-Unknown-*/, 37994 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Iron Horde continue to bring in reinforcements from all over Draenor to reinforce their position at Hellfire Citadel. If we don''t cut off the flow of supplies then we risk losing control of our plans in Tanaan.\n\nA strategic attack to the supply lines at Ironhold Harbor is just the thing to keep the Iron Horde on the defensive and maintain our momentum.', `VerifiedBuild`=20253 WHERE `Id` IN (37891 /*-Unknown-*/, 37970 /*-Unknown-*/, 38439 /*-Unknown-*/, 39445 /*-Unknown-*/, 39446 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Ok, Darkmoon Racer, let''s see what you got!\n\nThe real race has four legs: get to the blue post, then green, then red, then back here. \n\nYour time matters, so do it fast!', `VerifiedBuild`=20253 WHERE `Id`=37910; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Here''s the big one! Good luck out there!\n\nThis race has four legs: get to the purple post, then green, then red, then back here. \n\nYour time matters, so do it fast!', `VerifiedBuild`=20253 WHERE `Id`=37911; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In Frostfire Ridge, a Thunderlord sage by the name of Argoram seems to have uncovered the whereabouts of a storied weapon, known to the orcs as Gronnsbane. \n\nHe was last spotted headed into Magnarok. Find him and see if he can lead you to this relic.', `VerifiedBuild`=20253 WHERE `Id`=37914; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Looking through Argoram''s journal, it becomes apparent that claiming this relic will be far more complicated than simply finding the pieces of the spear.\n\nHowever, that would be the best place to start...', `VerifiedBuild`=20253 WHERE `Id`=37916; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The weapon has been assembled, but it lacks the power that made it a legend. In order to restore it, you must receive three blessings: one of fire, one of frost, and one of beasts.\n\nThe first blessing mentioned in the journal is that of fire. The journal reads:\n\n"He describes an ancient monolith, perched upon the edge of a precipice extending from the cliff where the searing magma falls into the sea.  I believe the location he speaks of is just overlooking Tor''goroth''s Tooth."', `VerifiedBuild`=20253 WHERE `Id`=37917; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The weapon has been imbued with the Blessing of Fire, drawing power from the Molten Shamanstone. The Frozen Shamanstone should impart the next blessing. Argoram mentions its location in his journal:\n\n"As I was maneuvering away from the great boulders hurled at me by the ogron brutes, I glanced what looked like another monolith atop the tallest of the snow-capped towers in Bloodmaul. Perhaps this is the Frozen Shamanstone, which is thought to grant the Blessing of Frost"', `VerifiedBuild`=20253 WHERE `Id`=37918; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Gronnsbane now pulses with energies of fire and frost. All that remains to restore the full power of the weapon is to receive the Blessing of the Beast. Argoram believed this could be accomplished by bloodying the weapon against one of the ancient black rylaks of Stonefury Cliffs. His journal reads:\n\n"High in the Stonefury Cliffs, I have seen an altar where the ogres have left offerings to these ancient beasts. Perhaps I could use it to lure one of them"', `VerifiedBuild`=20253 WHERE `Id` IN (37919 /*-Unknown-*/, 37995 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Iron Horde continues to bring in reinforcements from all over Draenor to reinforce their position at Hellfire Citadel. If we don''t cut off the flow of supplies then we risk losing control of our plans in Tanaan.\n\nA strategic attack to the supply lines at Ironhold Harbor is just the thing to keep the Iron Horde on the defensive and maintain our momentum.', `VerifiedBuild`=20253 WHERE `Id`=37940; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In Gorgrond, the Laughing Skull clan has a legend of one called Skulltaker. His mask, known only as the Silent Skull, is legendary among the clan, and could help us learn more about them.\n\nUntil recently, he was thought to have vanished. Now it appears he has shown his face, so to speak, in Everbloom Wilds. The last orc to have seen him fell to the botani there, but may still have some clues on how you can find Skulltaker and recover the mask.\n\nIf the botani have him, he may not be cooperative.', `VerifiedBuild`=20253 WHERE `Id`=37941; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Grinning Tolg was in the process of brewing an elixir that would allow him to communicate with the ravagers, whom the Skulltaker relies on to remain hidden.\n\nThe first ingredient, the leaves of the Shadethistle plant, can be found nearby. The journal reads:\n\n"It rests in the shadows of the harsh Gorgrond sun. I saw some under standing stones near the black iron walls."', `VerifiedBuild`=20253 WHERE `Id`=37942; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The second ingredient to the elixir is a vine from the Bonethorn plant. The journal reads:\n\n"I must find a vine of bonethorn, which grows in the bones of the ancient dead. I remember seeing the bones of a long-dead beast in the dry beds of the northern wilds. Its sun-parched skull would make a pleasant home for such a plant."', `VerifiedBuild`=20253 WHERE `Id`=37943; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The final component of the elixir is a handful of Steamcap mushrooms. The journal reads:\n\n"The Crowfeeder said that they grow among the steam vents in the higher parts of the Everbloom. I have seen one such place above the northern hydra pools."', `VerifiedBuild`=20253 WHERE `Id`=37944; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='With the reagents found, you should seek out Grinning Tolg''s camp in the nearby cave to brew the elixir. \n\nOnce the elixir is consumed, you should be able to communicate with the ravagers there. With any luck, they should be able to bring you to Skulltaker.\n\nHis mask should bring a hefty reward.', `VerifiedBuild`=20253 WHERE `Id` IN (37945 /*-Unknown-*/, 37996 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='You know what would boost morale around here?\n\nBass. Beats. Music!\n\nEveryone loves a party! You go out and get me some hardware, and I''ll make a system that will shatter Draenor itself.', `VerifiedBuild`=20253 WHERE `Id` IN (37961 /*-Unknown-*/, 38315 /*-Unknown-*/, 38401 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Up in the hills of Tanaan Jungle, the Sargerei have converted a once-sacred temple into a den of demonic summoning.\n\nWe must attack them now, before their rituals complete. The longer we delay, the stronger our enemy grows.', `VerifiedBuild`=20253 WHERE `Id` IN (37968 /*-Unknown-*/, 38449 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='I have heard of a draenei artificer by the name of Maatun that was seeking to restore an old draenei crystal, possibly of naaru origin. He called the crystal the Dream of Argus. \n\nThe draenei went missing after seeking out help from the Shadowmoon orcs back before they allied themselves with the Iron Horde. One of your scouts recently spotted a draenei matching the description of Maatun near the entrance of the Pillars of Fate. Go there and see what you can dig up.', `VerifiedBuild`=20253 WHERE `Id`=37973; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In his quest to restore the Dream of Argus, Maatun enlisted the help of three orcs. These same orcs betrayed him and took the crystal shards before they could be combined. If you find these orcs, they may still have them.\n\nThe first target shouldn''t be far. The journal reads:\n\n"I was told she spent most of her time in the crystal cave to the north of the encampment. There she studied the native crystals for ways to improve their potential abilities."', `VerifiedBuild`=20253 WHERE `Id`=37976; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The second orc that Matuun mentioned was a master runecarver and sorcerer. He should be located somewhere in the main camp. The journal reads:\n\n"She mentioned that the orc could normally found in one of the runemaster''s huts in the southern part of the camp. They could be identified by the standing stones surrounding the structure, as well as the floating runestones above."', `VerifiedBuild`=20253 WHERE `Id`=37977; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The last orc to be found was a hermit who kept away from the bulk of the Shadowmoon orcs at the Pillars of Fate camp, but was often seen in the high hills above. The journal reads:\n\n"It is said, however, that he can often be seen among the graves upon the high hill, overlooking the camp below.  There he would commune with the dead ancestors, whom it is said he preferred over his living brethren."', `VerifiedBuild`=20253 WHERE `Id`=37978; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Now that the keys have been activated, the Apexis device that leads to the amulet should be accessible. \n\nThe Arakkoa research states that it is likely located in Lost Veil Anzu, within the "shrine to the raven god."', `VerifiedBuild`=20253 WHERE `Id`=37993; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Sargerei council continues to work in secret with the warlock, Gul''dan. Up in the hills of Tanaan Jungle, they have converted a once-sacred temple into a den of demonic summoning.\n\nWe must attack them now, before their rituals complete. The longer we delay, the stronger their forces become.', `VerifiedBuild`=20253 WHERE `Id`=38022; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=85, `RewardMoneyDifficulty`=2, `RewardBonusMoney`=0, `AllowableRaces`=18875469, `VerifiedBuild`=20253 WHERE `Id`=2205; -- Seek out SI: 7
UPDATE `quest_template` SET `QuestDescription`='The Bleeding Hollow provide significant reinforcement to the Iron Horde in Tanaan. From their home in Zeth''Gol they relentlessly pursue our scouts, disrupt our operations, and gather more power for Gul''dan''s magic.\n\nWe should consider a direct raid on Zeth''Gol to make them pull back their forces across the valley. This should give us some breathing room... for a time.', `VerifiedBuild`=20253 WHERE `Id` IN (38044 /*-Unknown-*/, 38045 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardMoney`=175, `RewardBonusMoney`=0, `VerifiedBuild`=20253 WHERE `Id`=2218; -- Road to Salvation
UPDATE `quest_template` SET `RewardCurrencyQty1`=1000, `VerifiedBuild`=20253 WHERE `Id` IN (38149 /*-Unknown-*/, 38150 /*-Unknown-*/, 38151 /*-Unknown-*/, 38152 /*-Unknown-*/, 38153 /*-Unknown-*/, 38154 /*-Unknown-*/, 38155 /*-Unknown-*/, 38156 /*-Unknown-*/, 38157 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardCurrencyQty1`=2000, `VerifiedBuild`=20253 WHERE `Id` IN (38158 /*-Unknown-*/, 38159 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardCurrencyQty1`=300, `VerifiedBuild`=20253 WHERE `Id` IN (38160 /*-Unknown-*/, 38161 /*-Unknown-*/, 38162 /*-Unknown-*/, 38163 /*-Unknown-*/, 38164 /*-Unknown-*/, 38165 /*-Unknown-*/, 38166 /*-Unknown-*/, 38167 /*-Unknown-*/, 38168 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardCurrencyQty1`=800, `VerifiedBuild`=20253 WHERE `Id` IN (38169 /*-Unknown-*/, 38170 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Recent reports suggest a notable rise of activity by Sargerei forces at Socrethar''s Rise in southern Shadowmoon Valley.\n\nSocrethar''s disciples pose a threat all over Draenor. We must not allow them to gain a foothold so far from our reach.', `VerifiedBuild`=20253 WHERE `Id`=38183; -- -Unknown-
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=33555378, `QuestDescription`='I don''t mean to scare you, $n, but the last five thieves I sent to steal the southsea treasure came back to me in pieces.$B$BSouth along the coast you''ll find Tide Razor, the southsea freebooter''s ship. Nestled in the hold is the payoff - the southsea treasure. On the second level of that ship is the pirate''s den, a place where they train all of their thieves.$B$BBoard that ship, steal the treasure, and bring it back to me. Use the pirate''s den if you need to practice your thievery, but be careful!\n', `VerifiedBuild`=20253 WHERE `Id`=2381; -- Plundering the Plunderers
UPDATE `quest_template` SET `QuestDescription`='The Shadow Council have recruited the Sethekk and other power hungry Arakkoa to their service. Our allies in the Order of the Awakened have tracked them to a ruin in the west of Tanaan where the Shadow Council is instructing them in the use of fel magic.\n\nWe must strike at them before they can master their diabolic powers.', `VerifiedBuild`=20253 WHERE `Id` IN (38250 /*-Unknown-*/, 38252 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='It is clear the cave is protected by powerful ghosts, ancestors of the Bleeding Hollow.\n\nWhatever is down there, it will be easier to deal with if many of the spirits were dealt with first.', `VerifiedBuild`=20253 WHERE `Id`=38273; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If you wish to know what Kilrogg and his new master intend, you will need his eye. After the ritual all chieftains place their eye under the protection of the ghosts of the Bleeding Hollow in the next chamber.\n\nGo and locate the Eye of Kilrogg in the vault. The other chieftains will not stand with us, and will fight you for it.\n\nThen place it on the ritual mark nearby to get your answers.', `VerifiedBuild`=20253 WHERE `Id`=38274; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I hate to be too cynical, but I don''t think we''re gonna find Nolan in one piece. Or in a lot of pieces.\n\nNolan was a nut for finding rare coins. He''s been from one end of the world to the other finding them, and now he''s gone and gotten himself killed looking for more mint condition Draenei coins. Tell you what - let me show you what these coins look like, you bring me a few more of them and I''ll set up an exhibit in his honor.', `VerifiedBuild`=20253 WHERE `Id`=38345; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I told him this was a fool''s errand. Of course he would get himself killed over a handful of coins! Oh well, there are always new lovers to find.\n\nYou''ll have to do in the mean time. And you are quite easy on the eyes, aren''t you? Be a dear and find me more coins that look like this one? I need them for... research.', `VerifiedBuild`=20253 WHERE `Id`=38346; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It''s a bit quiet around here, in between the invasions and all.\n\nYou''re in luck though, Commander! I can fix that, and boost morale among your troops all at the same time.\n\nAll you need to do is bring me a few items from around Draenor, and I''ll fill your garrison with music. I''ll even throw in a few music rolls from my own collection to get you started!\n\nWhat do you say?', `VerifiedBuild`=20253 WHERE `Id`=38356; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='This is intolerable! The coins you brought me do not match the rest of the coins I already have! You aren''t counterfeiting these are you? No? Hrumph. In that case I''m sorry we fought, dearie.\n\nThere''s only one thing to do, buttercup: we need to complete the new set you''ve discovered. Bring me more misprinted coins!', `VerifiedBuild`=20253 WHERE `Id`=38395; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Auchenai have been reporting for some time that something was... wrong... with Auchindoun. They were never able to find a reason. Suddenly the Sargerei attacked and blew open a hole into a subchamber.\n\nCorruption leaks from that hole, we need to stop it.', `VerifiedBuild`=20253 WHERE `Id`=38416; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='An attack such as this was unexpected. They have deployed heavily and it will take me some time to marshal enough forces to root them out.\n\nAny Sargerei you can slay will make retaking this area much easier commander.', `VerifiedBuild`=20253 WHERE `Id`=38417; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Ah, $n, welcome back. It seems you enjoyed the effect of the robust, operational imbue, derived from snickerfang. Be warned, while the immediate effect is a titanic burst of strength, the long term effects on your spirit and intelligence could be hazardous.$B$BWith that said, do you require more? If so, bring me another three snickerfang jowls, two blasted boar lungs, and one scorpok pincer.', `VerifiedBuild`=20253 WHERE `Id`=2582; -- Rage of Ages
UPDATE `quest_template` SET `QuestDescription`='You live! This is good news, indeed. I assume you are back for more of the scorpok assay?$B$BVery well, $n, back to the wasteland with you and do not return until you have collected three scorpok pincers, two vulture gizzards, and one blasted boar lung.', `VerifiedBuild`=20253 WHERE `Id`=2586; -- Salt of the Scorpok
UPDATE `quest_template` SET `QuestDescription`='The Iron Horde is growing stronger each day as their war machines are empowered with fel magic. We have even obtained word that they are constructing a Fel Reaver!\n\nHead to the Fel Forge and destroy their forces before we are overwhelmed.', `VerifiedBuild`=20253 WHERE `Id` IN (38440 /*-Unknown-*/, 38441 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='While you were playing with fel fire, I''ve located the perfect position for an assault outpost.\n\nFollow me and we can get this base started!', `VerifiedBuild`=20253 WHERE `Id`=38445; -- -Unknown-
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=-1, `QuestDescription`='It''s unanimous, $n. You''ve got the ''itis.''$B$BLuckily, I have a cure for the ''itis.''$B$BHere''s what I need: One bundle of simple wildflowers, one leaded vial, one bronze tube, and last but certainly not least, one spool of light chartreuse silk thread. Ol'' Emma left a spool of it for me at ''The Finest Thread.'' You can find the shop along the canals.$B$BHurry along now, $n, and try not to touch anyone until you''re cured. Oh, and Dr. Montgomery says you need a shower -- his words, not mine.', `VerifiedBuild`=20253 WHERE `Id`=2609; -- The Touch of Zanzil
UPDATE `quest_template` SET `QuestDescription`='Commander, now that we''ve had time to get scouts all over the jungle we have heard some news near Zeth''Gol.\n\nIt appears that somebody else has a vendetta against the Bleeding Hollow and has been... hunting... them. Their hunters are closing in on the assassin.\n\nYou know what they say about "the enemy of my enemy..." We should collect their tracking maps and try to find the killer first!', `VerifiedBuild`=20253 WHERE `Id` IN (38453 /*-Unknown-*/, 38560 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Commander, you have a visitor. One of Gul''dan''s warlocks just walked up to the base and surrendered. He says he has information of a terrible event that is about to occur.\n\nI suggest you speak with him immediately.' WHERE `Id` IN (38458 /*-Unknown-*/, 38561 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The ritual site is already prepared, and it is protected by a barrier... one that I created. I can destroy the barrier, but I will need three items currently in use at Forge Camp Vengeance.\n\nIf you can get those ritual items, I will meet you at the Corrupted Refuge and remove the barrier. Even if it kills me.' WHERE `Id`=38462; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Your ally and I will remove this barrier now, though it will take a greater part of our strength. What lies beyond will not be easy.\n\nGul''dan will have empowered an elemental lord with the Cipher, driving it insane. He will use it to destroy the link between the elements and Draenor. If you destroy that elemental, we could recover the Cipher.' WHERE `Id` IN (38463 /*-Unknown-*/, 39394 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Auchenai have been reporting for some time that something was... wrong... with Auchindoun since Teron''gor''s original assault. Now suddenly the Sargerei attacked and blew open a hole into one of the underhalls.\n\nCorruption leaks from that breach. We must investigate!', `VerifiedBuild`=20253 WHERE `Id`=38562; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='This attack surprised our defenders. Forces are marshalling to push them out, but it will take some time for them to arrive.\n\nAny Sargerei you can slay will make retaking this area much easier commander.', `VerifiedBuild`=20253 WHERE `Id`=38565; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Shadow Council are summoning their demonic masters upon a mountain they are calling the Throne of Kil''jaeden. Make no mistake; This is the most dangerous region in Tanaan.\n\nGather together a war party and assault the Throne of Kil''jaeden before the Legion gains a foothold here!', `VerifiedBuild`=20253 WHERE `Id` IN (38585 /*-Unknown-*/, 38586 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Shadow Council are summoning their demonic masters upon a mountain they are calling the Throne of Kil''jaeden. Remember the first war, we know the destruction the legion can cause if they are unchecked.\n\nHead to the Throne of Kil''jaeden and let''s put an end to this invasion before it can begin.', `VerifiedBuild`=20253 WHERE `Id` IN (38587 /*-Unknown-*/, 39453 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Shadow Council are summoning their demonic masters upon a mountain they are calling the Throne of Kil''jaeden. We know the destruction the legion can cause if they are left unchecked.\n\nHead to the Throne of Kil''jaeden and let''s put an end to this invasion before it can begin.', `VerifiedBuild`=20253 WHERE `Id` IN (38588 /*-Unknown-*/, 39454 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='$G Sir : Ma''am;, we built a vehicle to take ya up to the Throne of Kil''jaeden but whenever we try a test flight the navigation system goes crazy!$b$bIn my expert opinion it''s ''cause of that crazy demon magic the Iron Horde is playing around with up there.\n\nIf you could travel up there and place these telemetry beacons we can program the vehicle and give you a stable flight all the way up.\n\nJust be sure to have some friends with you, the demons up there look especially vicious!', `VerifiedBuild`=20253 WHERE `Id`=38599; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='$G Sir : Ma''am;, we built a vehicle to bypass the Horde camp and take you to the Throne of Kil''jaeden! There''s one problem, the concentrated fel energy up there is causing the navigation system to go haywire!\n\nI''ll need you to place some sensors along the edge of the summit. With them in place we can stabilize the flight controls.\n\nJust be sure to have some friends with you, the demons up there look especially vicious!', `VerifiedBuild`=20253 WHERE `Id`=38603; -- -Unknown-
