UPDATE `quest_template` SET `QuestDescription`='The Iron Horde continue to bring in reinforcements from all over Draenor to reinforce their position at Hellfire Citadel. If we don''t cut off the flow of supplies then we risk losing control of our plans in Tanaan.\n\nA strategic attack to the supply lines at Ironhold Harbor is just the thing to keep the Iron Horde on the defensive and maintain our momentum.' WHERE `Id` IN (38876 /*-Unknown-*/, 38877 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='A great Darkmoon prize do you now seek, but be ye warned, it is not for the meek.\n\nYour very first clue to send you on this caper, you will find printed on the back of this paper.', `VerifiedBuild`=20253 WHERE `Id`=38934; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If you are to breach the walls of the citadel, you must first face siege equipment and forces led by Siegemaster Mar''tak.\n\nI wish you luck in gaining entry to Hellfire Citadel with your limbs intact.', `VerifiedBuild`=20253 WHERE `Id`=39193; -- -Unknown-
