UPDATE `quest_template` SET `QuestDescription`='In the Hellfire Citadel, they work to corrupt a magnaron with fel energy within the Pits of Mannoroth.\n\nIf you delve into the fel pools of that place, be on your guard.', `VerifiedBuild`=20253 WHERE `Id`=39221; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='A council of orc clans has assembled and must be adjourned... permanently.\n\nGurtogg Bloodboil of the Bleeding Hollow, Jubei''thos of the Burning Blade, and Dia Darkwhisper of the Shadowmoon clan can all be found within the accursed walls of Hellfire Citadel.', `VerifiedBuild`=20253 WHERE `Id`=39222; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Kilrogg Deadeye has led his clan down a dark path that he cannot return from.\n\nDemon blood coursing through his veins, he awaits the moment of his death--or yours--in Hellfire Citadel.', `VerifiedBuild`=20253 WHERE `Id`=39223; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Falling into the heart of the mausoleum in Auchindoun, Teron''gor gorged upon hundreds of draenei souls, becoming a bloated abomination in the process. \n\nNo longer recognizable as an orc, Teron''gor gave up his old name and has taken on the mantle of Gorefiend.', `VerifiedBuild`=20253 WHERE `Id`=39225; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''m afraid I have bad news about someone we once trusted. The arakkoa known as Iskar has gone too far in his desire to regain flight, and has joined with Gul''dan to regain his highborn body.\n\nWith it came the price of fel corruption and being doomed to fall at your hands.', `VerifiedBuild`=20253 WHERE `Id`=39226; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Exarch betrayer, Socrethar, was defeated with the assistance of Lady Liadrin and Exarch Maladaar.\n\nBut, he has returned. His vile spirit  is now within the Soulbound Construct in Hellfire Citadel, and must be destroyed once again.', `VerifiedBuild`=20253 WHERE `Id`=39227; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Tyrant Velhari was once a promising vindicator, but has turned to Shadow for reasons known only to her.\n\nPurge this Eredar of darkness.', `VerifiedBuild`=20253 WHERE `Id` IN (39228 /*-Unknown-*/, 39256 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='We believe Grommash has not yet accepted Gul''dan''s offer, and may even have avoided drinking the blood offered to him.\n\nBut Gul''dan has set Fel Lord Zakuun on Grommash. This demon is Gul''dan''s best-known torturer.\n\nI fear for Grommash. If he is turned, I fear for us all.', `VerifiedBuild`=20253 WHERE `Id`=39229; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Summoned by Gul''dan from the depths of the Twisting Nether, Xhul''horac is one of most powerful of the Void Revenants--a race of parasitic void-beings that tear holes through the planes of reality, consuming and absorbing the energies and beings within.\n\nGul''dan has twisted Xhul''horac, feeding him overwhelming fel energy, and using his powers to tear open the portals through which he plans to rally the forces of the Burning Legion.', `VerifiedBuild`=20253 WHERE `Id`=39230; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We believed we were done with Mannoroth, at least for a time. But Gul''dan is more powerful than we had predicted.\n\nMannoroth is nearly back in this world. His bones have been seen within the citadel, and he must be destroyed before he can reach his full power.', `VerifiedBuild`=20253 WHERE `Id`=39231; -- -Unknown-
