UPDATE `quest_template` SET `RewardBonusMoney`=14650, `AllowableRaces`=33555378, `QuestDescription`='Engineering at the expert level breaks into two disciplines: gnome and goblin.  While I think it is a waste, you should be aware of gnome specialization.  They make items and gadgets that claim to change the world, but rarely work.$B$B$n, read this manual.  If you wish to learn how to make metal paper weights, then take the manual to Oglethorpe Obnoticus in Booty Bay.   Remember - membership is permanent and prevents joining the other discipline, so make sure you are sure before finishing his task.', `VerifiedBuild`=20253 WHERE `Id`=3637; -- Gnome Engineering
UPDATE `quest_template` SET `QuestDescription`='Dem fancy cat-men gotta be shown who is da boss ''round dese parts. Kill all their champions, and ya will earn da respect of all creatures in da jungle.\n\nY''gonna need dese totems to draw dem out.', `VerifiedBuild`=20253 WHERE `Id`=39565; -- -Unknown-
