UPDATE `quest_template` SET `RewardBonusMoney`=0, `QuestDescription`='Ah, a summoner''s orb--this is where the taint must be coming from. We must exorcise the demon within it if you''re to use it. That I can do easily.$B$BYou''re the one who has the hard job.  You must kill the demon once I release it.$B$BAnd you''ll have to be quick.  If you take too long then he''ll return to the orb and we''ll have to start over!$B$BSo get yourself ready, $n.  Prepare your strongest spells and keep your potions handy, and go get a friend if you have one.  Because this isn''t going to be pretty.', `VerifiedBuild`=20253 WHERE `Id`=4961; -- Cleansing of the Orb of Orahil
UPDATE `quest_template` SET `RewardBonusMoney`=0, `AllowableRaces`=-1, `QuestDescription`='Well, well, well... a pleasure to see you''re growing in power, $n. I''d wager you''d be about ready to speak to Menara Voidrender in the Barrens. If you haven''t spoken to her before, then let me tell you, I don''t think I''ve ever met another expert in the creation of items--orbs specifically--that can inprison even a demon to serve our will so easily.$B$BIf you''re interested, she''s in Strahad''s tower above Ratchet in the Barrens.', `VerifiedBuild`=20253 WHERE `Id`=4965; -- Knowledge of the Orb of Orahil
