UPDATE `quest_template` SET `RewardMoney`=25000, `RewardMoneyDifficulty`=7, `RewardBonusMoney`=0, `AllowableRaces`=-1, `QuestDescription`='War must be fought with soldiers, any soldier will tell you.  They''ll also say that a battle fought with poor gear or on an empty stomach is lost before it starts!$B$BThat is why Arathi Basin is important.  There are key areas in the basin that hold essential resources.  Metals, weapons, food, lumber - all are needed, and all can be gained there.$B$BThat is what I want from you, $n.  Enter Arathi Basin, win the battle by holding more bases than the enemy, and return to me with a crate of resources.', `VerifiedBuild`=20253 WHERE `Id`=8080; -- Arathi Basin Resources!
