UPDATE `quest_template` SET `QuestDescription`='It is time for your first lesson in the ways of the Light, $n. As you fight more battles, it will bring you closer to the light, and you''ll start to uncover new abilities.\n\nGo, get more experience, and learn a new ability. Return and demonstrate it for me, and we''ll continue your training.', `VerifiedBuild`=20253 WHERE `Id`=10069; -- Well Watcher Solanian
UPDATE `quest_template` SET `QuestDescription`='As you grow in power, you''ll start to figure out the tricks of the trade.$B$BOne of the first things you''ll probably figure out is how to Eviscerate your enemy after landing some initial attacks.\n\nGet some experience, learn how to do it, and then find one of the training dummies outside and give it a try. ', `VerifiedBuild`=20253 WHERE `Id`=10071; -- Well Watcher Solanian
UPDATE `quest_template` SET `QuestDescription`='By now, you''ve heard the rumors about our kind, the warlocks. Pay them no mind; they are uttered by those jealous of our fearsome powers.$B$BAs you become more experienced, you will uncover mysteries of controlling fel energies. \n\nGo, continue your journey until you uncover a new technique. I want you to practice using this new spell on the training dummies outside the Sunspire.', `VerifiedBuild`=20253 WHERE `Id`=10073; -- Well Watcher Solanian
UPDATE `quest_template` SET `RewardBonusMoney`=30, `AllowableRaces`=33555378, `QuestDescription`='Return to your world, $n. Go to my grandchild and tell him that his blood is here - on this shattered world.$B$BTell him that his father''s legacy lives on.$B$BTell him everything...\n', `VerifiedBuild`=20253 WHERE `Id`=10175; -- Thrall, Son of Durotan
