UPDATE `quest_template` SET `QuestDescription`='I be feelin'' that this Durak be more than he seems. Demonic power be dangerous, it easy to fall to its corruption even for a trained warlock. \n\nI don''t be trustin'' em, $n.\n\nYa go find this Durak and tell ''em de horde will have nothing ta do with em.', `VerifiedBuild`=20253 WHERE `Id`=13842; -- Dread Head Redemption
UPDATE `quest_template` SET `QuestDescription`='I''m Bamm Megabomb, your personal trainer, $g sir : ma''am;.$B$BI understand that you''re interested in some new insight about being a $c?\n\nLook. Just get some more experience , and you''ll learn how to do more of what it is you do best. Helpful, right?$B$BSo go, get some more experience, then when you learn how to do something new go ahead and try it out on one of the dummies here.', `VerifiedBuild`=20253 WHERE `Id`=14007; -- Steady Shot
UPDATE `quest_template` SET `QuestDescription`='I''m Fizz Lighter, your personal trainer, $g sir : ma''am;.$B$BI understand that you''re interested in some new insight about being a $c?\n\nLook. Just get better at what you already know, and you''ll learn how to do more of what it is you do best. Helpful, right?$B$BSo go, get some more experience, then when you learn how to do something new go ahead and try it out on one of the dummy''s here.\n', `VerifiedBuild`=20253 WHERE `Id`=14008; -- Arcane Missiles
UPDATE `quest_template` SET `QuestDescription`='I''m Sister Goldskimmer, your personal trainer, $g sir : ma''am;.$B$BI understand that you''re interested in some new insight about being a $c? \n\nLook. Just get some more experience , and you''ll learn how to do more of what it is you do best. Helpful, right?$B$BSo go, get some more experience, then when you learn how to do something new go ahead and try it out on one of the dummies here.\n', `VerifiedBuild`=20253 WHERE `Id`=14009; -- Flash Heal
UPDATE `quest_template` SET `QuestDescription`='I''m Slinky Sharpshiv, your personal trainer, $g sir : ma''am;.$B$BSo ya wanna get better at being a rogue, eh?\n\nLook. Just get some more experience , and you''ll learn how to do more of what it is you do best. Helpful, right?$B$BSo go, get some more experience, then when you learn how to do something new go ahead and try it out on one of the dummy''s here.', `VerifiedBuild`=20253 WHERE `Id`=14010; -- Eviscerate
UPDATE `quest_template` SET `QuestDescription`='I''m Evol Fingers, your personal trainer, $g sir : ma''am;.$B$BI understand that you''re interested in some new insight about being a $c?\n\nLook. Just get some more experience , and you''ll learn how to do more of what it is you do best. Helpful, right?$B$BSo go, get some more experience, then when you learn how to do something new go ahead and try it out on one of the dummies here.', `VerifiedBuild`=20253 WHERE `Id`=14012; -- Immolate
UPDATE `quest_template` SET `QuestDescription`='<The Warrior-Matic NX-01 comes online.>$B$BBoss $n detected. I am Warrior-Matic NX-01.$B$BWarning: Insufficient Skill Detected! Please gain more experience to learn new skills. \n\nDemonstrate new skills against training dummies to continue training course.', `VerifiedBuild`=20253 WHERE `Id`=14013; -- Charge
UPDATE `quest_template` SET `QuestDescription`='You have much to learn, $n.  And I''ve much to teach you.$B$BThese are perilous times, however, and I fear that you may need to learn much on your own$B$BHave no fear, $g brother:sister;.  The Light will guide us through this.\n\nGo, get more experience, and learn a new skill. Use it against the bloodfang worgen nearby.', `VerifiedBuild`=20253 WHERE `Id`=14279; -- Flash Heal
UPDATE `quest_template` SET `QuestDescription`='The path ahead is difficult, $n.  We must devote the entirety of our mental power to the task at hand.$B$BAs you begin to grow in power, new pathways to the arcane will begin to materialize in your mind. You''ll begin to develop spells you did not know before.\n\nGo, get more experience, and then use what you learn against the Bloodfang Worgen.', `VerifiedBuild`=20253 WHERE `Id`=14281; -- Arcane Missiles
UPDATE `quest_template` SET `QuestDescription`='We were driven to the edge of extinction once before, $n.  But we druids, keepers of the old ways, saved our people from famine.$B$BWhen we cut ourselves off from the outside world and our crops failed, it was our order who called upon the earth''s blessings and restored the harvest.$B$BJust as our powers restored the crops, your growth in power will develop your connection to our ancient arts.\n\nGo, develop your powers, and use what you learn against the Bloodfang Worgen.', `VerifiedBuild`=20253 WHERE `Id`=14283; -- A Rejuvenating Touch
UPDATE `quest_template` SET `QuestDescription`='Excellent!  Let''s get started.$b$bAs you grow in power, your connection to the arcane arts will deepen, and you''ll gain access to new spells and abilities.\n\nGo, get some more experience, and you''ll see what I mean. Come back when you learn something new and demonstrate it on the training dummies here.', `VerifiedBuild`=20253 WHERE `Id`=24526; -- Filling Up the Spellbook
UPDATE `quest_template` SET `QuestDescription`='Excellent!  Let us begin.$b$bAs you grow along your journey, you will unlocked the ancient secrets of shamans. \n\nPrimal Strike is the first such skill.  The primal spirits, when called upon, will strengthen your arm to deliver a mighty blow.$b$bHelpful, isn''t it?', `VerifiedBuild`=20253 WHERE `Id`=24527; -- Your Path Begins Here
UPDATE `quest_template` SET `QuestDescription`='The life of a hunter is steeped in tradition, ye know.  Trackin'' mighty beasts through rugged terrain.  Drinkin''.  Travelin'' the land, yer gun at yer side.  Drinkin''.  Survivin'' on wits and courage and cunning, followed by a good stiff drink.$b$bBut before we get to the good stuff, though, ye''ll need to learn how to do the beginner stuff.\n\nGo and get some more experience, and ye''ll figure out how to do more things. Then ye'' drink.', `VerifiedBuild`=20253 WHERE `Id`=24530; -- Oh, A Hunter's Life For Me
UPDATE `quest_template` SET `QuestDescription`='Lesson one.  Aside from your sword and shield, what''s the most important tool you have in your arsenal?$b$b<Thran awaits your response.>$b$bOh never mind, I''ll answer it for you.  It''s experience.\n\nAs you get more experience, you''ll discover new techniques, which means you can be much more effective than you imagined.\n\nGo, get some experience, and learn something new. Then come back and demonstrate.', `VerifiedBuild`=20253 WHERE `Id`=24531; -- Getting Battle-Ready
UPDATE `quest_template` SET `QuestDescription`='When you get to be more experienced, you''ll start to find you can take advantage of new abilities. \n\nOne of the things that you''ll learn is the ability to use combat maneuvers to weaken an opponent, and then hit them with a devastating technique.\n\nGo and get some experience, figure out how to do it, and then try it out on some of the dummies here.', `VerifiedBuild`=20253 WHERE `Id`=24532; -- Evisceratin' the Enemy
UPDATE `quest_template` SET `QuestDescription`='Now, if ya DO want to become somethin'' special, ye''ll need to talk to me.  A priest is nothin'' without his spells.  And how do you learn new spells?\n\nYa go and get more experience. So go out, get stronger, and then come show me what ya learn.', `VerifiedBuild`=20253 WHERE `Id`=24533; -- Words of Power
UPDATE `quest_template` SET `QuestDescription`='Get a load of these guys, would ya? Steamwheedle''s been handling the business of holidays for years, and all of a sudden, these guys bust into the market. They''re not Steamwheedle; the cartel hired me to get to the bottom of this. Something stinks here and it ain''t just perfume.\n\nTake this device I brought and go analyze the perfume clouds around the guards. I want to know what they''re putting in that stuff. Things ain''t natural.', `VerifiedBuild`=20253 WHERE `Id` IN (24536 /*Something Stinks*/, 24655 /*Something Stinks*/);
UPDATE `quest_template` SET `QuestDescription`='I knew they were up to no good! There''s some sort of mind-affecting chemical in here, but I can''t get a handle on it with such a small sample. I need the real stuff.\n\nDon''t just go over there and buy it! I don''t want you giving these scumbags one copper. Nah, you gotta get it from the source, discreet-like.\n\nI''ll disguise you as a package runner. I saw a stockpile guarded by their goons outside the gates. Go run by, and DON''T stop, or they''ll make you! They''ll toss you a crate. Bring it back here.', `VerifiedBuild`=20253 WHERE `Id` IN (24541 /*Pilfering Perfume*/, 24656 /*Pilfering Perfume*/);
UPDATE `quest_template` SET `QuestDescription`='As ya'' develop ya'' powah, ya'' gonna start to tink of new spells, new ways to use ya'' arcane talents. \n\nGo now, grow ya'' skills, and ''den come back an'' show me what ''cha figure out.', `VerifiedBuild`=20253 WHERE `Id`=24752; -- The Arts of a Mage
UPDATE `quest_template` SET `QuestDescription`='As ya grow in powah, you begin ta discovah the voices of da ancestahs speakin'' to ya, teachin'' you dere secrets.\n\nTha first of ''dese is to focus tha power of da elements into yer weapon. It allows ya to unleash a quick, vicious attack on your enemies. Dis should be easy enough for ya to make a lot of use of it.$B$BTry it out. Let me know when ya tink you have it down.', `VerifiedBuild`=20253 WHERE `Id`=24760; -- The Arts of a Shaman
UPDATE `quest_template` SET `QuestDescription`='As ya grow in powah, ya ability to call on nature gets strongah, too. Ya wanna see?\n\nGo get some experience and show me what ya'' learn.', `VerifiedBuild`=20253 WHERE `Id`=24766; -- The Arts of a Druid
UPDATE `quest_template` SET `QuestDescription`='As ya fight ya enemies, ya will learn new tricks you use ta be even bettah''. \n\nThere''s one ya should be learnin'' soon to let ya see dere weaknesses and set up for devastating combo attacks. After ya''ve struck a few blows to weaken ya foe, finish dem off with a vicious evisceration attack.\n\nWhen ya learn it, try it out. Let me know when ya tink you have it down.', `VerifiedBuild`=20253 WHERE `Id`=24772; -- The Arts of a Rogue
UPDATE `quest_template` SET `RewardMoney`=-2000000, `VerifiedBuild`=20253 WHERE `Id` IN (24822 /*A Change of Heart*/, 24838 /*A Change of Heart*/, 24840 /*A Change of Heart*/, 24843 /*A Change of Heart*/, 24845 /*A Change of Heart*/);
UPDATE `quest_template` SET `RewardMoney`=296000, `RewardMoneyDifficulty`=8, `RewardBonusMoney`=600, `AllowableRaces`=52430847, `VerifiedBuild`=20253 WHERE `Id` IN (24869 /*Deprogramming*/, 24873 /*Residue Rendezvous*/, 24875 /*Deprogramming*/, 24878 /*Residue Rendezvous*/);
UPDATE `quest_template` SET `QuestDescription`='Let''s get some work done, shall we?\n\nAs you grow in power, your connection to the arcane will deepen, granting you access to new spells.\n\nYou''ll see. Go, get some more experience, then come back and demonstrate what you''ve learned.', `VerifiedBuild`=20253 WHERE `Id`=24965; -- Magic Training
UPDATE `quest_template` SET `QuestDescription`='A Forsaken priest is a curious beast,$b$g his: her; path an unusual course.$b$G His: Her; shadowy rites cannot come from the Light, so $g he: she; seeks a more sinister source.$b$bNot only has the world forsaken us, $n... it seems the Light has left us as well.  As the poem hints, however... we are not without power.\n\nGo, get more experience, grow your power. Return to me, and demonstrate what you have learned.', `VerifiedBuild`=20253 WHERE `Id`=24966; -- Of Light and Shadows
UPDATE `quest_template` SET `QuestDescription`='Quiet down!  I don''t want these novices around us to hear what we''re about to discuss.$b$bListen up... $n, is it? Soon, you''ll learn something that''ll change the way you operate as a rogue.  You''ll be able to follow up on your attacks with a deadly finishing move. Maybe even slide a dagger between their vertebrae.\n\nTo learn it, you just gotta get some more experience. Don''t worry, you''ll figure it out.', `VerifiedBuild`=20253 WHERE `Id`=24967; -- Stab!
UPDATE `quest_template` SET `QuestDescription`='As you continue your career as a warlock, you''ll begin to hear the voices of fel power... they will reveal their secrets, teaching you new spells.\n\nI want to see you learn a new spell and try it out on one of the dummies here.', `VerifiedBuild`=20253 WHERE `Id`=24968; -- Dark Deeds
UPDATE `quest_template` SET `RewardMoney`=154000, `RewardBonusMoney`=146300, `VerifiedBuild`=20253 WHERE `Id`=25137; -- Valley of Trials: PRK - H - Warlock Pet Imp
UPDATE `quest_template` SET `QuestDescription`='You already know how to fire an arcane shot. Good. But doing so depletes your focus. To gain your focus back you will need to switch to a second type of ranged attack.\n\nGo out and get some more experience. As you do, you''ll learn some new abilities. The first of these will help you get your focus back.', `VerifiedBuild`=20253 WHERE `Id`=25139; -- Steady Shot
UPDATE `quest_template` SET `QuestDescription`='As you grow in power by gaining levels, you will discover the power to use new abilities. The first you will discover on your journey is Primal Strike.\n\nUse it to deliver a strike with your weapon, infused with the power of the elements.$B$BIt is time to learn and master your new skill. Practice using it on the training dummies outside the Den.', `VerifiedBuild`=20253 WHERE `Id`=25143; -- Primal Strike
UPDATE `quest_template` SET `QuestDescription`='It is my duty to train you, and I intend to do just that.$B$BAs you become more powerful, you will begin to hear the fel voices revealing new spells to you.\n\nGo, get more experience, learn a new spell, and then practice your new spell against one of the training dummies around here.', `VerifiedBuild`=20253 WHERE `Id`=25145; -- Immolate
UPDATE `quest_template` SET `QuestDescription`='Alright, here''s the easy part.\n\nAll you have to do to deepen your connection to the arcane is to get more experience and grow your power. You''ll begin to find that you can cast new spells.\n\nYou''ll see. Go try it, and show me what you learn.', `VerifiedBuild`=20253 WHERE `Id`=25149; -- Arcane Missiles
UPDATE `quest_template` SET `RewardMoney`=77000, `VerifiedBuild`=20253 WHERE `Id`=25289; -- One Step Forward...
UPDATE `quest_template` SET `RewardMoney`=125, `RewardMoneyDifficulty`=4, `RewardBonusMoney`=0, `VerifiedBuild`=20253 WHERE `Id`=25331; -- Grandma's Cat
UPDATE `quest_template` SET `RewardMoney`=154000, `VerifiedBuild`=20253 WHERE `Id` IN (25470 /*Lady Of Da Tigers*/, 25480 /*Dance Of De Spirits*/);
UPDATE `quest_template` SET `QuestDescription`='As you go on wild adventures and grow your power, you''ll start to develop new connections to the arcane, granting you new spells.\n\nYou''ll see. Go do it! Show me what you learn! I''ll be here.', `VerifiedBuild`=20253 WHERE `Id`=26198; -- The Arts of a Mage
UPDATE `quest_template` SET `QuestDescription`='I''m not at all surprised that a warlock like you fought your way out of Gnomeregan. Few people, even among the gnomes, truly understand the nature of the power we wield.\n\nAs you become more powerful, you''re going to start hearing the fel voices revealing their secrets to you, teaching you new spells.\n\nI want you to go get some more experience. Once you learn something new, show me.', `VerifiedBuild`=20253 WHERE `Id`=26201; -- The Power of a Warlock
UPDATE `quest_template` SET `QuestDescription`='As you learn more and become a better rogue, you''ll start to learn new abilities.$B$BOne of the most potent ones is to chain together moves in a combination, exploiting your enemy''s weakness and opening up the opportunity to use stronger maneuvers.\n\nGo, get some more experience and figure out how to do it. Once you can, come back here and try it out.', `VerifiedBuild`=20253 WHERE `Id`=26207; -- The Arts of a Rogue
UPDATE `quest_template` SET `QuestDescription`='Far to da east de "Worldbreakers" lay hidden in da Twilight Highlands. We must end their threat and we gonna do it with da most powerful army ever!\nOur new allies, de goblins, dey be making us new machines of war but I hear dat der be problems wid da quality. We can''t fight wid broken machines. Speak ta Foreman Glibbs an'' make sure me machines be ready for battle.', `VerifiedBuild`=20253 WHERE `Id`=26293; -- Machines of War
UPDATE `quest_template` SET `QuestDescription`='Da Highlands be da home of de Dragonmaw orcs. If we show dem our might they would ally with us against da Twilight''s Hammer for sure.\n\nDa fleet be gathering at Bilgewater Port in Azshara but there be reports of delays.\nYa did good wid getting da goblins ta work, I be needing ya skills here too.\nFind Warlord Krogg in Azshara and see what be taking so long.', `VerifiedBuild`=20253 WHERE `Id`=26324; -- Where Is My Warfleet?
UPDATE `quest_template` SET `QuestDescription`='The Twilight''s Hammer agents still be wanderin'' Orgrimmar. I need someone I trust ta collect the final evidence of treachery.\n\n<Vol''jin pulls you aside.>\n\nI suspect that Sauranok the Mistic be involved. I need you ta uncover the truth, $n.  Da Twilight''s Hammer has placed their agents within the workers at the airship docks ta spread their lies across da land. Speak with dem, if ye be findin'' evidence of Sauranok''s guilt then show him what happens to traitors of the Horde.', `VerifiedBuild`=20253 WHERE `Id`=26830; -- Traitor's Bait
UPDATE `quest_template` SET `QuestDescription`='Few people, especially among our allies, truly understand the nature of the power we wield. They shun us for pursuing knowledge that they are too weak to use properly.$B$BAs you become more powerful, you will begin to discover new spells, further magnifying your power.\n\nGo, get more experience, then return once you''ve learned a new spell. We''ll see if you have it in you to truly master the dark arts.', `VerifiedBuild`=20253 WHERE `Id`=26904; -- Harnessing the Flames
UPDATE `quest_template` SET `QuestDescription`='Now that you''ve had the chance to test your abilities in battle, it''s time to explain one more reason why training is so important.$B$BAs you get more experience, you''ll be able to do new techniques you never thought of.\n\nGo, get some experience, learn a new skill, and demonstrate it on one of the training dummies.', `VerifiedBuild`=20253 WHERE `Id` IN (26913 /*Charging into Battle*/, 31142 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='We must take care in how we speak around the abbey and its environs, but don''t let that deter you from the path of power.$B$BAs you become more powerful, you will begin to hear the fel voices, granting you their power in the dark arts.\n\nGo, get more experience and learn a new spell. Once you have, practice it on the training dummies.', `VerifiedBuild`=20253 WHERE `Id`=26914; -- Immolation
UPDATE `quest_template` SET `QuestDescription`='As a mage, you will learn a variety of spells as your understanding grows. All you need to do is get some more experience, and the secrets of the arcane will reveal themselves to you.\n\nYou''ll see. Go develop your powers, and show me what you learn.', `VerifiedBuild`=20253 WHERE `Id`=26916; -- Mastering the Arcane
UPDATE `quest_template` SET `QuestDescription`='As you continue in your journey as a Paladin, you''ll become closer to the light, learning new abilities.\n\nGo, get more experience, and learn a new ability. Demonstrate it for me, and we will continue your training.', `VerifiedBuild`=20253 WHERE `Id`=26918; -- The Power of the Light
UPDATE `quest_template` SET `QuestDescription`='One of your responsibilities as a priest is caring for the wounded. Another is to go out into the world and be more... proactive about defending them.$B$BAs you do so, you''ll grow in power and learn all sorts of new things.\n\nWhy don''t you go out, get more experience, and then return to demonstrate what you''ve learned?', `VerifiedBuild`=20253 WHERE `Id`=26919; -- Healing the Wounded
UPDATE `quest_template` SET `QuestDescription`='We are the heirs to a legacy of arcane magic and your path will not be an easy one. Many still hold us responsible for the actions of our forebears, but our talents are needed.$B$BThough you must be cautious, it is important to develop your powers, as that will deepen your connection to the arcane and grant you access to new spells.\n\nGo - get more experience with your spells, and demonstrate what you learn for me.', `VerifiedBuild`=20253 WHERE `Id`=26940; -- Arcane Missiles
UPDATE `quest_template` SET `QuestDescription`='Druids play an important role in our society, but all too often we are seen as passive dreamers in a world that is changing around us.$B$BThe truth is, though, we must actively practice and go out onto the world to develop our connection to nature.\n\nSo go, get some more experience. You will begin to feel your connection deepen, learning new skills. Demonstrate the first you learn for me.', `VerifiedBuild`=20253 WHERE `Id`=26948; -- Rejuvenating Touch
UPDATE `quest_template` SET `QuestDescription`='As you venture out into the world and develop your skills, you will begin to learn new abilities that you never knew you had within you.\n\nI''d like you to go out, get some more experience, and then show me the first new ability you learn.', `VerifiedBuild`=20253 WHERE `Id`=26949; -- Healing for the Wounded
UPDATE `quest_template` SET `QuestDescription`='As a paladin, you''re no stranger to the Light that touches all of us. But you also have the unique power to call upon the Light to help you in battle.$B$BAs you gain more experience, you''ll grow even closer to the Light and be able to call upon new powers in battle.\n\nGo, grow in experience until you have learned a new power, and then demonstrate it for me.', `VerifiedBuild`=20253 WHERE `Id`=26966; -- The Light's Power
UPDATE `quest_template` SET `QuestDescription`='In your future as a mage, you''ll want to master a wide variety of spells. To do so, you need to deepen your connection by the arcane by growing in power.\n\nGo, get more experience as a mage, and demonstrate what you learn for me.', `VerifiedBuild`=20253 WHERE `Id`=26968; -- Arcane Missiles
UPDATE `quest_template` SET `QuestDescription`='Your walk with the elemental powers will take you to many places. As you grow in power, you will begin to learn new abilities. \n\nLet us start your journey with a simple, but useful, lesson.\n\nLearn the secret of Primal Strike, and then practice your new skill using the training dummies to the northwest of the Crash Site. Return to me when you are finished.', `VerifiedBuild`=20253 WHERE `Id`=26969; -- Primal Strike
UPDATE `quest_template` SET `QuestDescription`='As a priest, one of your most important duties is to use the Light''s power to aid the wounded.\n\nAnother is to use your power offensively, to protect them.\n\nAs you grow more experienced, you will begin to uncover new abilities that you can use in your charge. Go, gain more experience, and then demonstrate the abilities you have learned to me.', `VerifiedBuild`=20253 WHERE `Id`=26970; -- Aiding the Injured
UPDATE `quest_template` SET `QuestDescription`='You have done well. As you continue along your path, you will grow, learning new techniques that you couldn''t have imagined before.\n\nYour first lesson is the power of experience. Go, learn a new ability, and demonstrate it for me.', `VerifiedBuild`=20253 WHERE `Id` IN (27020 /*The First Lesson*/, 31166 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='It is always a pleasure to meet a fellow Sunwalker. We are not as numerous as some of the more ancient orders, but our ways are no less powerful and our members no less respected.$B$BAs you continue on your journey, you will grow closer to the light and gain abilities you couldn''t have imagined.\n\nGo, get more experience, and return when you''ve learned a new ability. Demonstrate it to me.', `VerifiedBuild`=20253 WHERE `Id`=27023; -- The Way of the Sunwalkers
UPDATE `quest_template` SET `QuestDescription`='I know you''ve been busy helping the braves protect Camp Narache from the bristlebacks. We''re going to need all the hammers and all the luck we can get.\n\nAs your skills increase, so does your connection to the elements. This gives you access to new abilities.\n\nThe first of these that we learn is Primal Strike. It should help you fell your enemies faster. Learn it, and then try it out.', `VerifiedBuild`=20253 WHERE `Id`=27027; -- Primal Strike
UPDATE `quest_template` SET `QuestDescription`='As you become more skilled, your skills will expand, and you will gain access to many new powers.\n\nGo - get some experience out there, and come back to me when you''ve learned something new. You can demonstrate on the training dummies nearby.', `VerifiedBuild`=20253 WHERE `Id`=27066; -- Healing in a Flash
UPDATE `quest_template` SET `QuestDescription`='As you develop your skills, druid, you will begin to feel your connection to the Earthmother deepening. You will begin to understand new secrets of nature, and learn to cast new spells.\n\nGo now, get more experience, and return to me when you''ve learned a new spell. Demonstrate what you''ve learned.', `VerifiedBuild`=20253 WHERE `Id`=27067; -- Rejuvenating Touch
UPDATE `quest_template` SET `RewardMoney`=45000, `VerifiedBuild`=20253 WHERE `Id`=28236; -- The Lost Brother
UPDATE `quest_template` SET `QuestDescription`='Alright. According to the clues you found, that was Anduin''s ship, and Admiral Taylor was the captain. \n\nAnd Admiral Taylor''s last entry says he was going to fight off the hozen and protect the vessel after the shipwreck.\n\nThe locals say these hozen sometimes take prisoners, and I didn''t see Taylor''s corpse anywhere among the wreckage. So you''ll probably find Taylor at the hozen encampment to the northeast.\n\nGet going, we have no time to lose!', `VerifiedBuild`=20253 WHERE `Id`=29553; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Alright, soldier. I''ve got a critical mission for you.\n\nGet down to the coastline south of here - in the cove there you''ll find a wrecked Alliance vessel. I need you to search it and find out if it was the ship that was carrying Anduin. \n\nThen, recover the Captain''s Log and see if it has any information on where we can find him.\n\nSince the log is from a military ship, it''ll be written using a cipher - take it to Nodd Codejack afterwards. He''s keeping watch on the wreck from the other end of the cove.', `VerifiedBuild`=20253 WHERE `Id`=29555; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve located an Alliance wreck to the south. Unfortunately, the locals have informed us that it''s currently being scavenged by a group of creatures called "hozen."\n\nBy pillaging our wrecked ships, these creatures have already shown that they aren''t friendly. We can''t have them taking spoils from our ships, stealing our supplies, and worse, potentially capturing or killing any survivors.\n\nGet down there and take them out! When you''re done, meet up with Nodd Codejack, our SI:7 agent in the area.', `VerifiedBuild`=20253 WHERE `Id`=29556; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=2, `VerifiedBuild`=20253 WHERE `Id`=30045; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=114000, `RewardBonusMoney`=4900, `VerifiedBuild`=20253 WHERE `Id` IN (30284 /*-Unknown-*/, 30338 /*-Unknown-*/, 30340 /*-Unknown-*/, 30341 /*-Unknown-*/, 31679 /*-Unknown-*/, 31758 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='My son - can you find my son?\n\nWhen the Jinyu attacked, he ran off in the confusion. I don''t know if they''ve done anything with him, or if he''s still alive, even.\n\nNothing else matters if I can''t find him. \n\nI''d ask Mei... but something''s wrong with her. She seems too... impulsive since the attack. I just can''t trust that she''d bring him back safely.', `VerifiedBuild`=20253 WHERE `Id`=30467; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Of course, the first priority is finding my son. But, if we save ourselves only to starve, then what have we accomplished, in the end?\n\nPlease, I need you to recover some of the supplies that the Jinyu took from our caravan.', `VerifiedBuild`=20253 WHERE `Id`=30469; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='From the moment I first rose from the river, I knew I was destined to be Waterspeaker.\n\nI was taught many rituals, and have performed all of them, save one.\n\nThere was one, an extremely ancient one, that we were told to call upon if our people ever turned against us. \n\nThis must have happened in our people''s distant past, because we haven''t needed to use it in our village''s memory.\n\nI suppose now is the time to do so.', `VerifiedBuild`=20253 WHERE `Id`=30480; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='<Admiral Taylor winces in pain.>\n\nJade Forest was a disaster. \n\nAnduin''s gone. We lost some good people. We didn''t stop the Horde from advancing into the continent. \n\nBut I think I''ve found a way to get the locals on our side. You just helped fight off some of these "yaungol", no?\n\nI hear yaungol sacked Westwind Rest, a local village. We''ve been told that two groups of survivors have camped out along the road west out of town.\n\nWe help them out, maybe they''ll consider siding with the Allliance.', `VerifiedBuild`=20253 WHERE `Id`=30512; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I am injured, but we can''t stop here.\n\nThe hozen were... unreliable. The pandaren would be much better allies.\n\nYou have seen the refugees in this village, and heard of the yaungol invasion, no?\n\nWell, we''ve heard from the locals that Eastwind Rest, a nearby village, was destroyed by the Yaungol.\n\nApparently some survivors have gathered along the road out of town.\n\nGo. Take the road west. Gather the survivors. \n\nWe''ll help them rebuild. Then, they will see the advantage of joining the Horde!', `VerifiedBuild`=20253 WHERE `Id`=30513; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The yaungol have always been a difficult, proud people, but never this violent or aggressive. \n\nI do not know what has prompted this change in their behavior, but we don''t have time to find out, now. We fear for our lives and livelihoods as long as Ur-Bataar, leader of the Bataari yaungol, lives.\n\nGo, set the banner in his camp ablaze to challenge him, and then defeat him in battle. Only then will we be secure.', `VerifiedBuild`=20253 WHERE `Id` IN (30514 /*-Unknown-*/, 30515 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='I... I escaped from Farmer Chow''s, to the southeast of here. It''s been taken over by yaungol, but the old man and his wife just won''t give it up!\n\nPlease, go there and help him out. Maybe if you do, he''ll be willing to send some folks back here and help you guys farm up some food for the new town?', `VerifiedBuild`=20253 WHERE `Id`=30569; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I... I escaped from Farmer Chow''s, to the southeast of here. It''s been taken over by yaungol, but the old man and his wife just won''t give it up!\n\nPlease, go there and help him... Maybe if you do, he''ll be willing to send some folks back here and help you guys farm up some food for the new town?', `VerifiedBuild`=20253 WHERE `Id`=30570; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Mobility is going to be key to maintaining our foothold in this new land. Problem is, there''s no way to maintain mobility without mounts, and... well, we don''t have many of those here, now do we?\n\nThe local yaks seem to make good mounts. At least, the local pandaren say they do. Why don''t you go round some up for us?', `VerifiedBuild`=20253 WHERE `Id`=30575; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Oi!\n\nWe need ta'' get us some food, if we''re gonna survive here for long!\n\nYe'' may not know it, but I''m somethin'' of a cook me''self. Why don''tcha go out there and fetch us some meaty bits. I can cook ''em up and feed us for weeks! Or, days, at least.', `VerifiedBuild`=20253 WHERE `Id`=30583; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I know your friends are worried about the animating statues over at Mogujia, but I''ll tell you what you should really be worried about.\n\nWhere there are animated statues, there are mogu. I don''t know if you''ve seen one before, but if you haven''t...\n\nWell, let''s just say mogu are bad, bad, news.\n\nWhile you''re dealing with whatever else you''re doing, you need to get the mogu behind the trouble!', `VerifiedBuild`=20253 WHERE `Id`=30619; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I know your friends are worried about the animating statues over at Mogujia, but I''ll tell you what you should really be worried about.\n\nWhere there are animated statues, there are Mogu. I don''t know if you''ve seen one before, but if you haven''t...\n\nWell, let''s just say Mogu are bad, bad, news.\n\nWhile you''re dealing with whatever else you''re doing, you need to get the Mogu behind the trouble!', `VerifiedBuild`=20253 WHERE `Id`=30620; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Look, I know the Alliance needs recruits, and there''s just not enough of us here right now to make a fighting presence of this town.\n\nBut I know that the yaungol over at Fire Camp Ordo, to the northwest, have taken many of my people as prisoners. And I also know that if you would be willing to rescue them from their captivity, they''d more than likely be willing to join the Alliance.\n\nWhat do you say, $n?', `VerifiedBuild`=20253 WHERE `Id`=30650; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Look, I know the Horde needs recruits, and there''s just not enough of us here right now to make a fighting presence of this town.\n\nBut I know that the yaungol over at Fire Camp Ordo, to the west, have taken many of my people as prisoners. And I also know that if you would be willing to rescue them from their captivity, they''d more than likely be willing to join the Horde.\n\nWhat do you say, $n?', `VerifiedBuild`=20253 WHERE `Id`=30655; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I sent for reinforcements from the Shado-Pan Monastery, but have heard nothing back. We have already lost the town.\n\nA few lucky villagers may have survived, but we are pinned down here.\n\nWe do not have time to entertain strangers. If you can fight, help my men defend this tower. If not, leave, for you will not survive long here.', `VerifiedBuild`=20253 WHERE `Id`=30665; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our true enemies are the sha, not the yaungol.\n\nThe sha are emotion manifest. Destructive, yes. But undisciplined. Undisciplined force cannot last. The flood, in dispersion, loses its force. The wildfire burns its fuel.\n\nAnd, discipline and wisdom can turn their destructive energy against themselves.\n\nBring me the essences of the sha in the village, and I will explain further.', `VerifiedBuild`=20253 WHERE `Id`=30670; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I can''t believe you made it here!\n\nI don''t know how much longer I could have stayed hidden in here.$B$BI''m sure that there are others. $C, we have to rescue them! Then we can go to Shado-Pan Fallback. The master there will know what to do!', `VerifiedBuild`=20253 WHERE `Id`=30682; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Simply killing Kobai will accomplish nothing, as he is possessed by a particularly powerful and destructive Sha - Malevolent Fury.\n\nYou will use the trap I have fashioned from the Blinding Rage Essences you brought. Lure him into the trap, and then steal his mask. Once you put it on, Malevolent Fury will appear and attempt to take control of you.\n\nDefeat him, and we will have made a victory of this tragic situation. You can find him to the north of the retreat, where he taunts us in insane rage.', `VerifiedBuild`=20253 WHERE `Id`=30690; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The battle against the Sha is eternal - we can not leave this place. \n\nBut I am troubled by the absence of reinforcements from the Monastery given that we sent for them days ago. \n\nYou have performed admirably, perhaps you could travel to Winter''s Blossom, our base camp on the way to the Shado-Pan Monastery. Speak with Lin Silentstrike once you arrive - he should know what is happening. To get there, travel north of the village and follow the road through Shado-Li Basin to Winter''s Blossom.', `VerifiedBuild`=20253 WHERE `Id`=30699; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve managed to push them back this far, but I doubt that we will remain safe for long if we do not deal with them once and for all.\n\nMy husband, coward or fool that he is, does not wish to provoke them. I will not be cowed so.\n\nWe will do just that. Slay their forward scouts. Perhaps we can provoke - and then defeat - their leader.', `VerifiedBuild`=20253 WHERE `Id`=30710; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='And, now they fear you.\n\nTheir leaders, a Blademaster and a Mage, lie deeper in the ruins. Kill them.\nMake them hurt. For us.', `VerifiedBuild`=20253 WHERE `Id`=30714; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='When we regrouped after their initial attack, we numbered three less. You can fight, and we must plan our defense should these cursed yaungol attack again. \n\nIf you would help us, grant our fallen comrades their last rites, and recover their armor. You will find their bodies to the west, near the gate.\n\nAnd try to keep the birds off them.', `VerifiedBuild`=20253 WHERE `Id`=30715; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Hmm... If Shado-Master Chong trusted you, perhaps you can help us.\n\nThe yaungol are our enemies.\n\nStill, we must prove we are better than they. We will show them honor in death.\n\nAs after most battles, the carrion birds have begun gathering. Thin their numbers, so the bodies of our foes will not be desecrated. They''ve gathered at the battlefield to the west.', `VerifiedBuild`=20253 WHERE `Id`=30723; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='They are attacking again!\n\n<Lin looks to the Ox Gate.>\n\nArchers... on the wall!\n\nI need you to get up there. My wife Suna went to scout the wall with that fool Lao-Chen. Perhaps if he had spent more time preparing defenses and less building that ridiculous ale lift contraption...\n\nIt matters not. Get a kite from Len, to the west, and then get up there and find my wife. She''ll know what to do next.', `VerifiedBuild`=20253 WHERE `Id`=30724; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The yaungol on the wall here are providing covering fire for the ones below. I don''t know what Lao-chen is thinking, but I want you to deal with these archers.\n\nThe good news is, up here we''ve got the spirit of the Ox helping us. When they''re weakened, the ox spirit will stun them and you can use it to knock ''em off the wall.\n\nYou''ll find the archers just out that door.', `VerifiedBuild`=20253 WHERE `Id`=30750; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I have an idea, and... am prepared to make a terrible sacrifice.\n\nAs much as I know that we need my stout brew, to fortify our defenders for the long-term security of the Ox Gate...\n\nIt is too painful to discuss details now, but please - while you are up here defending the wall, gather the barrels of oil they are using to light their arrows. We will need them.', `VerifiedBuild`=20253 WHERE `Id`=30751; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I simply refuse to believe the guards will not grant us entry to the monastery should we impress upon them the seriousness of the situation.\n\nFriend, go east, to the sentinel in front of the Monastery, and demand admittance. I will come with you.', `VerifiedBuild`=20253 WHERE `Id`=30752; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Lin...\n\nI don''t care what Ban, Lao-Chin, or even Taran Zhu says. I''m moving ahead into Townlong. I may not be able to save Lin myself, but I''m not going to sit around waiting for everyone else to catch up.\n\nOnce Taran Zhu opens the doors to his precious monastery, we''ll save Lin. Until then, I''ll scout ahead and make sure he''s alright.', `VerifiedBuild`=20253 WHERE `Id`=30768; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I... am alive... but barely. They killed the rest. My friends... and family...\n\nI must return to the village... But, I do not have long, and cannot move on my own... are you a healer? I... have a healing potion in my hut... search my belongings. You can use your magic, if you have it.', `VerifiedBuild`=20253 WHERE `Id`=30794; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='After the mercenaries robbed us, most left.\n\nBut one of them... after the others took all we had, he ran the rest of us through. For sport!\n\nGet justice for the fallen. Perhaps news of their death will raise my spirits enough to go on.\n\nYou''ll find them just west of here.', `VerifiedBuild`=20253 WHERE `Id`=30805; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Many have perished here. We will need to honor them properly, which means gathering the makings of incense of life. \n\nIt doesn''t just smell nice - it has restorative properties, and can even help plants grow. Maybe I can get a whiff of the ingredients to get me back on my feet.\n\nThe materials can be found on creatures around here - except for the spices, which were stolen by the mercenaries who pillaged the village. ', `VerifiedBuild`=20253 WHERE `Id`=30806; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I do not wish to dishonor my friends and leave them in unmarked graves.\n\nYet, we have never needed to bury so many at once, and I am in no condition to gather materials.\n\nPlease, visit the lakes that hug the mountains edge along the road to the south. Underneath the waterfalls there, you will find stones that have been polished to a sheen by the falling water. They will make suitable headstones.', `VerifiedBuild`=20253 WHERE `Id`=30807; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Thank you much, friend. After this tragedy, it is good that fortune has smiled on us and sent you.\n\nYou have gotten justice for my fallen friends, and gathered the necessary materials to honor them. I will gather their bodies, prepare the materials for their funerals, and meet you at the graveyard. \n\nIn the meantime, however, please return to my cousin and ask him to gather the villagers for the funeral.', `VerifiedBuild`=20253 WHERE `Id`=30819; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='As I said, I will gather the town - we will be at the funeral. \n\nAs the one who has done so much to honor our friends, we feel it is only right that you will be the one to light the Incense of Life and usher their spirits to the life beyond.', `VerifiedBuild`=20253 WHERE `Id`=30820; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Pools of the same murky substance that came out of Mei emerged in the lake recently.\n\nI will travel into the Mere with you. Point out the pools of corruption that you are ready for me to cleanse.\n\nYou will need to deal with whatever comes out and protect me as I complete the ritual.', `VerifiedBuild`=20253 WHERE `Id`=30828; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='They survived? My father is alive!\n\nI thought we would all die here in this horrible mere, at the hands of these insane Jinyu.\n\nI will find my way back - meet me back at camp.', `VerifiedBuild`=20253 WHERE `Id`=30834; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I can hear the voice of the Mere - it has been purified.\n\nBut, this chapter in my people''s history will never be closed - not until we defeat Shai Hu.\n\nHe has retreated to the central island in the Mere, corrupting our holiest of sites.\n\nBeware - he is strong. But, after all we have done, I am confident we will be stronger.', `VerifiedBuild`=20253 WHERE `Id`=30855; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=114000, `VerifiedBuild`=20253 WHERE `Id` IN (30881 /*-Unknown-*/, 30907 /*-Unknown-*/, 30965 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='When I trained as a Brewmaster, I didn''t expect to use my knowledge like this...\n\nDid you know beer catches fire when lit? Well, with yaungol oil mixed in, it''s downright explosive.\n\nI''ve mixed the oil in with these kegs. Roll them at the yaungol over by the gate, and ignite them when you get close. \n\nIt''ll take a few seconds for the keg to blow, but when it does...\n\nWell, let''s just say I wouldn''t want to be over there.\n\nWhich is why I''ll be over here. Mourning the loss of this brew.', `VerifiedBuild`=20253 WHERE `Id`=30991; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve heard back from Suna, on the wall. Something''s going on...\n\nIt looks like they are preparing for their final push. It''s time to finish this, friend.', `VerifiedBuild`=20253 WHERE `Id`=30992; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='This has simply gone too far. I cannot ignore our abandonment any longer.\n\nAfter all that''s happened here, and all you''ve been through in Firebough, we must travel to the monastery.\n\nWhatever they are doing in there can wait! We can take my balloon up the mountain to the Monastery. It''s anchored back by the camp, to the northeast.', `VerifiedBuild`=20253 WHERE `Id`=30993; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Alright. Thanks to you, we have the wall under control. Good job. \n\nI''ll stay up here for a little while and make sure no more yaungol get up onto the wall.\n\nYou, though, should go back down and see what Lao-Chin has cooked up. I hate to say it, but maybe he had a good idea after all...', `VerifiedBuild`=20253 WHERE `Id`=30994; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='This... is unspeakable. If the monastery has truly been taken over by the Sha, we will need a great effort to purge the monks inside of corruption.\n\nGather a group of your allies, and meet me inside the Monastery.', `VerifiedBuild`=20253 WHERE `Id` IN (31030 /*-Unknown-*/, 31031 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The Yaungol are a constant nuisance, but the group at Fire Camp Gai-Cho, to the northeast, conspired with the Osul yaungol in their recent incursion into Kun-Lai.\n\nWe cannot allow such an incursion to go unpunished.\n\nGo, attack Fire Camp Gai-Cho. We need to make sure they remain occupied, so that they cannot rise up and threaten The Ox Gate again.', `VerifiedBuild`=20253 WHERE `Id`=31113; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We have always left the Deadtalkers alone. For so long, they were just responsible for maintaining the sacred burial grounds of the yaungol tribes.\n\nNow, though, they are practicing dark magic, defiling the corpses of their former clanmates... \n\nI know not where they learned those dark magics, or why they no longer treat their dead with respect, but we do not have time to find out. \n\nWe need to stop them.', `VerifiedBuild`=20253 WHERE `Id`=31114; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The spirits that the Yaungol are entrapping from the remains of their ancestors still have a bit of the essence of life within them. \n\nIf you defeat the spirits in battle, you can collect essence from the spirits as dust, and then return it to the corpses in the area, which will send the spirits, finally, to the next life.\n\nThis is the only way to set right what the Deadtalkers have done. It will also help keep us safe.', `VerifiedBuild`=20253 WHERE `Id`=31116; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We need to understand what went wrong with the Deadtalkers. \n\nFor so many years, the Deadtalkers were simply responsible for maintaining the burial grounds and holding funerals for fallen warriors.\n\nFrom a recent raid, we''ve recovered a tablet from the grounds that is clearly written using a cipher, but it isn''t one we''ve encountered before. If you can gather a ciphered scroll from one of the Deadtalkers, we can begin to put together the cypher and understand what''s happened.', `VerifiedBuild`=20253 WHERE `Id`=31118; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mantid are our enemies. As are the yaungol at Fire Camp Gai-Cho.\n\nIt is fortunate, then, that they are also each other''s enemies. Mantid from Kri''vess constantly attack the Gai-Cho yaungol, who hold them off at their front gates.\n\nI want you to wreak havoc. "Borrow" some highly explosive oil barrels from camp Gai-Cho, and toss them down onto the battlefield from the air.\n\nI don''t care which ones you kill, just kill a lot of them.', `VerifiedBuild`=20253 WHERE `Id`=31119; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Cheng Bo is the Warbringer of Fire Camp Gai-Cho. While you''ve made a dent in their operations, you now have an opportunity to strike a major blow. \n\nSlay the Warbringer!', `VerifiedBuild`=20253 WHERE `Id`=31120; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It looks like you''re quite the fighter, $p.\n\nChao heard about it, and she''s been talking about how she''d kick your...\n\nWell, let''s just say I think you should challenge her and try to get her respect.', `VerifiedBuild`=20253 WHERE `Id`=31127; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Lao-Chin seems to have his head in the clouds... or, rather, in his beer.\n\nAfter all of his recent battles, he seems completely obsessed with with trying to develop the perfect brew for fighting. \n\nThat''s well and good, but we need him to actually do some fighting!\n\nYou should go challenge him, see if you can snap him out of his rut. \n\nIf you beat him, he''ll probably want to go out and help fight just to try to one-up you!', `VerifiedBuild`=20253 WHERE `Id`=31128; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Actually, before I go - you should speak with Novice Elreth. She had some work for you, and you would do well to help others and improve your skills.\n\nThe next time you see me, I will be in Undercity.' WHERE `Id`=31148; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The truth is, you already have the talent and ability to learn what you need to. What I can help you do is show you where to unlock it.\n\nFirst, you must practice until you begin to understand a new technique. The first technique you learn will be the Tiger Palm. Go, learn more until you have unlocked the potential within yourself, and then practice your new move!\n\nRemember - it''s all in the mind!', `VerifiedBuild`=20253 WHERE `Id`=31151; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='As you walk the road of your training, you will begin to discover within yourself the power to unlock new techniques. You need not even learn them from me, or another more experienced monk - you will find that they come to you on their own.\n\nFor now, you should go and practice the basics. Gather more experience, and develop a new technique - once you have, you can practice it on the dummies nearby to master it.', `VerifiedBuild`=20253 WHERE `Id`=31157; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I hope your people are all alright... the crash was unbelievably loud and destructive!\n\n<Mojo looks you over, evaluating your potential.>\n\nYes, you''ll do fine. They''ve said that they need more people to fight, and they don''t want me to hurt myself. I''m not afraid, but I don''t want to intrude. So, I''ll teach you.\n\nAs you may have discovered, your experiences in combat will unlock new potential within you. Go, see if you can master a new ability. Show it to me. You''ll get the hang of things.', `VerifiedBuild`=20253 WHERE `Id`=31173; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mantid outnumber us quite badly. Hundreds of them for each of us.\n\nAnd, they surround us on two sides - at Gao-Ran in the south we''re holding them off, but to the west, on the island they call Sra''vess, they continue to mass unabated.\n\nWe''re not stupid. We''re not going to launch a full scale attack on them. We can''t sustain an intense battle on multiple fronts.\n\nInstead, we''re going to send you, and one of our Wu Kao, to do some dirty work. Sounds fun, doesn''t it?', `VerifiedBuild`=20253 WHERE `Id`=31196; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Killing the smaller mantid works mostly as a distraction. It forces them to replenish their numbers before they consider any serious offensive.\n\nThe big ones, though - we kill a few of those, and we really disrupt operations on the island. That buys ourselves a substantial amount of time. With mantid, it''s like their size is directly proportional to their importance in the empire.\n\nSo kill some of the big ones for me, while you''re out there.', `VerifiedBuild`=20253 WHERE `Id`=31197; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mantid have statues built on Sra''vess. We don''t know exactly what they use them for. They may have some sort of religious significance, or maybe they assist with their sonic communication.\n\nWhen you fight your opponent, you don''t just engage them physically, you also engage them mentally. Whatever they use them for, the fact is that those statues are important to them.\n\nWhich is why I want you to blow them up. Losing something important will be a substantial hit to morale.', `VerifiedBuild`=20253 WHERE `Id`=31198; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mantid don''t just attack in swarms. \n\nThey''re smart. They use alchemy, bombs... and what''s worst, they''ve got siege weapons. Those have the potential to be incredibly destructive if they attack with them.\n\nWe''ve got reports that they''re building up a force of siege weapons to the west at Sra''vess. Go and destroy them.', `VerifiedBuild`=20253 WHERE `Id`=31199; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our alchemists have cooked up a set of gas bombs that will discourage mantid from staying anywhere that we set them off. \n\nIf we plant these in the critical structures of Sra''vess, they''ll need to evacuate. That should sow some chaos and delay any action from the mantid there for days.\n\nGet to it, $n.', `VerifiedBuild`=20253 WHERE `Id`=31200; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our scouts have sent a very troubling report. \n\nThree of our trainees have gone missing, and our scouts found them... \n\nThey''ve been captured by the mantid and sent to their Kunchong pits. \n\nTheir Kunchong FEEDING pits. We''re lucky that the Kunchong don''t eat that often.\n\nI need you to get in there, give them these escape kites, and get them out!', `VerifiedBuild`=20253 WHERE `Id`=31201; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='While we''re here, we should do one more thing.\n\nThe Sra''thik Swarmlord is responsible for directing the mantid forces from the air. If we leave it alive, it''s going to cause trouble for the garrison.\n\nSo we''re not going to leave it alive. Let''s take it out, $p.', `VerifiedBuild`=20253 WHERE `Id`=31203; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Near the ocean, on the eastern side of Sra''vess, there is a cavern that leads to a network of caves.\n\nFrom there, the Sra''thik Hivelord maintains Sra''vess and plots against us. If we manage to take him out, we''ll disrupt their operations for days.\n\nLet''s go to it.', `VerifiedBuild`=20253 WHERE `Id`=31204; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You''ve really been building up respect with the Shado-Pan, $n.\n\nNurong''s interested in trying out his skills against you.\n\nThe good news is, if you win, I''ll allow him to go with you on your missions.\n\nThe bad news is, I really don''t think you''ll win.', `VerifiedBuild`=20253 WHERE `Id`=31220; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='So... you''ve been challenged by the infamous Tenwu of the Red Smoke.\n\nThat''s what he calls himself, at least. He''s a good fighter, and a good rogue, but it''s a wonder he manages to sneak up on anyone with how loudly he brags about himself.\n\nAnyways, I think you should answer the challenge. Maybe it''ll give him a touch of humility. Maybe not. Either way, if you win, he''ll probably be willing to go with you on your missions. \n\nAnd I get some entertainment.', `VerifiedBuild`=20253 WHERE `Id`=31221; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Yeah, yeah.\n\nEveryone knows us goblins do tinkering. And explosives. And... well, ya'' know, the less reputable stuff.\n\nBut what nobody knows is that I''m really a great chef! It''s a hobby of mine.\n\nGather us up some meaty bits from the creatures around here, and I''ll cook us up the best meals ANYWHERE!\n\nAnd I promise, I''ll only use three or four percent rocket fuel.', `VerifiedBuild`=20253 WHERE `Id`=31251; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Well, far as I figure, we''ve got quite a lot of rebuildin'' to do.\n\nI''m not one for joining any big causes, but my farmhands aren''t gonna have much to do ''round here, to be honest. And, since you helped them out, they want to join your "Alliance." So, who am I to stop ''em?\n\nBring ''em with you, back to Farmhand Bo. I''ll miss ''em, but they''re better off with you.', `VerifiedBuild`=20253 WHERE `Id`=31252; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Well, far as I figure, we''ve got quite a lot of rebuildin'' to do.\n\nI''m not one for joining any big causes, but my farmhands aren''t gonna have much to do ''round here, to be honest. And, since you helped them out, they want to join your "Horde". So, who am I to stop ''em?\n\nBring ''em with you, back to Farmhand Ko. I''ll miss ''em, but they''re better off with you.', `VerifiedBuild`=20253 WHERE `Id`=31253; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Lok''tar, $c.\n\nWe''ve made progress, but we''re going to need mobility if we want to maintain our foothold here in Kun-Lai.\n\nI don''t see many worgs, kodo, or the like around here. What I do see are yaks. Our pandaren allies have said they make good mounts, so they''ll have to do.\n\nGo round some up and return them here, so we can get our people riding them!', `VerifiedBuild`=20253 WHERE `Id`=31256; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve heard reports of a group of Mogu infiltrating the coast here in Townlong. I have no idea what they are doing. Frankly, I don''t care. \n\nYou''ve proven yourself, so we''ve decided to give this mission to you.\n\nWhat''s going to happen is this - you''re going to go, find them, and kill them.\n\nOur scouts reported the first group landed to the north, between here and Deadtalker''s Plateau. Go there and wipe them out.', `VerifiedBuild`=20253 WHERE `Id`=31266; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Those damnable Mogu...\n\nThose scouts were a distraction! While we were hunting their spies, the main force moved on Niuzao Temple. Corrupted serpents, Mogu everywhere... this is a disaster!\n\nThankfully, Ban was able to make it past their lines with the most elite members of our order. If you can slip past, too, meet up with him. We need to put a stop to this!', `VerifiedBuild`=20253 WHERE `Id`=31277; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Usually, Merchant Shi comes through Kun-Lai Summit to trade with the Jinyu and Grummle. We''ve heard word that he hadn''t been seen at Binan, and we haven''t seen him here...\n\nI''m worried something has happened to him. Can you go to the Inkgill Mere and see if he''s there?', `VerifiedBuild`=20253 WHERE `Id` IN (31451 /*-Unknown-*/, 31452 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Our new recruits have spoken in hushed tones about a group of Pandaren they call the "Shado-Pan". They are apparently very strong, and secretive.\n\nIt''s clear that, no matter what happens here in Kun-Lai, making an alliance with these Shado-Pan will be critical to our foothold in Pandaria.\n\nThat''s where you come in. Rumor is they have a base of operations to the southeast, near Firebough Nook.\n\nYou will go there, and curry their favor. For the Horde!', `VerifiedBuild`=20253 WHERE `Id`=31453; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our new recruits have spoken in hushed tones about a group of Pandaren they call the "Shado-Pan". They are apparently very strong, and secretive.\n\nThat''s where you come in. Rumor is they have a base of operations to the southeast, near Firebough Nook. You should travel there as an envoy of the Alliance. Give them any help they require.', `VerifiedBuild`=20253 WHERE `Id`=31455; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There''s another Pandaren settlement out here, Muskpaw Ranch. I don''t know if they''re alright, what with everything that''s been going on with the Yaungol invasion.\n\nYou''ve been so helpful - you should go check up on them, friend!', `VerifiedBuild`=20253 WHERE `Id` IN (31456 /*-Unknown-*/, 31457 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='One of those grummles came by and said that Lorewalker Cho sent for you. You should go ahead and meet up with him, he might have something important to say.\n\nThe grummel said he''s at Onekeg, to the north.', `VerifiedBuild`=20253 WHERE `Id`=31459; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='One of those adorable little grummles came by and said that Lorewalker Cho sent for you. You should meet up with him!\n\nThe grummel said he''s at Onekeg, to the north.', `VerifiedBuild`=20253 WHERE `Id`=31460; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=456000, `RewardBonusMoney`=9850, `VerifiedBuild`=20253 WHERE `Id` IN (31524 /*-Unknown-*/, 31526 /*-Unknown-*/, 32000 /*-Unknown-*/);
UPDATE `quest_template` SET `LogDescription`='test log desc ! $1oa $1oo $1oo $1oa test cona $oo fodasse $o1x caracois $o1 crl\n\n*DO NOT LOCALIZE*ass', `QuestDescription`='test desc! $1oa $1oo $1oo $1oa test cona $oo fodasse $oa caracois $1ox $9o crlaasd\n\n*DO NOT LOCALIZE*asd', `QuestCompletionLog`='test comp text! $1oa $1oo $1oo $1oa test cona $oo fodasse $o1x caracois $o1 crlas\n\n*DO NOT LOCALIZE*das', `VerifiedBuild`=20253 WHERE `Id`=31694; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I am sure many of our associates will be requesting your services after your victory here. But I have received a request for aid from our defenders at the wall along the Dread Wastes.\n\nIf you would assist them, then take a kite and check in with Bowmistress Li.\n', `VerifiedBuild`=20253 WHERE `Id`=31847; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mogu are a bunch of right bastards!\n\nThey enslaved the pandaren who worked these caves even after their death. Ye'' gotta go free their spirits! It''s just not right.\n\nBe careful though... so much trauma, they don''t know what''s a friend and what''s an enemy. So they''ll probably fight back.', `VerifiedBuild`=20253 WHERE `Id`=32115; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='When I ordered the excavation of the tunnel to the northwest, I thought we''d find something useful. Gold, iron... anything!\n\nInstead, we found mogu artifacts, and I get a bunch of dwarves from the Explorers'' League to baby-sit.\n\nI hear from the soldiers that there''s trouble in the mines. I have orders from Wrynn that I have to support the Explorers'' League, but I can''t spare any troops. Can you get down there and find out what''s going on?', `VerifiedBuild`=20253 WHERE `Id`=32116; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The fools in the Explorers'' League have excavated an ancient mogu ruin to the northeast. And - of course - in their bumbling, they''ve disturbed the mogu spirits within.\n\nWe are going to take advantage of their ineptitude. Take this portal and meet with Kaelis Sunsoar, my contact within the ruins.', `VerifiedBuild`=20253 WHERE `Id`=32118; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There''s somethin'' down there that was spookin'' the workers. Some kind o'' anomaly... looks like a ghost, or a magic spell... like nothing I''ve ever seen.\n\nI did manage to get a reading on it and put together this device to try to track it down. The display on the device will let you know roughly how close you are. \n\nOnce you get close enough, you can use it to draw out the anomaly and get rid of it for good!', `VerifiedBuild`=20253 WHERE `Id`=32119; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The ruins which we are occupying were built by Ogudei - an ancient mogu ruler. We know little about who he was, though the rise of the spirits in this area seems to indicate that it was related to spirit binding.\n\nWhen you destroy these spirits, a small amount of their essence will remain in this world. Bring it to us - we will analyze it and hopefully learn more about Ogudei''s history - and his power.', `VerifiedBuild`=20253 WHERE `Id`=32120; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='In the ruins there are a bunch of right nasty blue crystals. Look at ''em the wrong way and bloody angry ghosts run out at ya.\n\nI''m gonna be needing ye'' to go in and clear some of them out so we can get our people back to work.', `VerifiedBuild`=20253 WHERE `Id`=32121; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='When we dug through to an ancient section of the mogu ruins, that''s when all this nasty business went down - and that''s where the two worst o'' these ghosties emerged.\n\nWe need them gone, friend.', `VerifiedBuild`=20253 WHERE `Id`=32122; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''ve got some customers lined up that wanna collect some good old fashioned ears. But not any old ears. They only want the absolute waxiest ears money can buy! \n\nGuess they think they''re lucky or something''.\n\nAnyways, I need you to go get ''em for me. I don''t want to hurt any animals, so you''ll need to get ''em from the Alliance over at Lion''s Landing.\n\nHave fun - and remember, only bring me the waxiest!', `VerifiedBuild`=20253 WHERE `Id`=32130; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Gnomes are excavating a stone quarry to the northeast.\n\nThey''re building stuff with it!\n\n<Zazzix rolls his eyes.>\n\nThey''re too stupid to realize it''s special mogu stone for creating animated statues. \n\nWE can mix with a little Goblin magic juice to make some real big explosions!\n\nBut the stuff is heavy. They''ve got some of their stupid bomb-bots there for excavating the stone. Blow ''em up near slabs and you''ll get chunks small enough to carry. \n\nOr, just kill ''em and take it. Whatever works.', `VerifiedBuild`=20253 WHERE `Id`=32131; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our goblin friends do not have the grasp of strategy necessary to win a long term engagement, I''m afraid.\n\nThe key to eliminating any permanent establishment is to attack their ability to replenish their troops and to rebuild.\n\nIn this case, that means taking out their Peasants. Kill them, and you weaken the foundation. The rest of the keep is bound to crumble.', `VerifiedBuild`=20253 WHERE `Id`=32132; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve spotted heavy air support over their base, in the form of way too many dwarves on way too many griffons. Means we can''t get any vision of the area from above.\n\nA troll... friend of mine gave us a set of Sentry Wards, which we can use to spy on their base and get a vantage point on what''s going on in there.\n\nBad news, friend - you''re going to be the one going in there.', `VerifiedBuild`=20253 WHERE `Id`=32133; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We''ve managed to get some Demolishers on the beach, but the stupid dwarves are also out there with their stupid mortar tubes, preventing the Demolishers from pushing forward and assaulting the keep itself!\n\nGet out there, kill some dwarves, and blow up some mortar tubes.', `VerifiedBuild`=20253 WHERE `Id`=32134; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There are some situations in which taking out one of their soldiers is more important than killing hundreds.\n\nThey''ve deployed some of their heroes to the battlefield to help rally their defenders. Not only will killing them soften their defense, it will also leave their morale crippled.\n\nSo go, take one down for me. You can handle it.', `VerifiedBuild`=20253 WHERE `Id`=32135; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Sure, they''ve got about plenty of grunts out there, pounding on our door, waiting to cut our heads off.\n\nI''m not worried about grunts. But they''ve got shamans and raiders, too. The shamans use their magic to empower the grunts, and the raiders are fast and specialize in taking out our buildings.\n\nI need you to get out there and kill some of those shamans and raiders.\n\nGo! Attack! Move!', `VerifiedBuild`=20253 WHERE `Id`=32148; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Oh, the poor peasants...\n\nThey are cowards, yes, of course. But they don''t know how to fight, and they go out to collect lumber for our efforts... the Horde targets them... It''s just awful all around!\n\nBut, we need that lumber if we''re going to hold out. Go out and collect any they''ve dropped.', `VerifiedBuild`=20253 WHERE `Id`=32149; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Horde decided to put goblins in charge of their logistics. And where you have goblins, you have carelessly placed explosives.\n\nScouts have reported that they have their supplies in carts that also contain demolisher ammunition. Look at those crates the wrong way, and they''ll blow sky high. \n\nWith enough Horde resources destroyed, we''ll put a time limit on their attack and save lives. So go and take out those carts!', `VerifiedBuild`=20253 WHERE `Id`=32150; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The gnomes are running our quarry operation to the northwest. The stone there is especially tough - the gnomes tell me the mogu used it to fashion their constructs. \n\nI don''t know. What I do know is that we use that stone to build our towers, and the Horde has dispatched the Bilgewater goblins to steal it from us.\n\nGet out there and get some back. By the way - collateral damage may break up the stone slabs there. If so, pick that up, too.', `VerifiedBuild`=20253 WHERE `Id`=32151; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Horde got the bright idea to send Bilgewater goblins to attack our quarry.\n\nThey''ve been packing heavy explosives - heavy explosives that will react with the ammunition in their demolishers.\n\nKill the Bilgewater goblins until you find an explosive, plant it on one of the demolishers... and BOOM! Siege ended.', `VerifiedBuild`=20253 WHERE `Id`=32152; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Look, you''re tough. Tougher than the rest of the men and women I''ve got here. Which means I need you for a special mission.\n\nThe Horde is throwing their best against us. Heroes of their armies - Blademasters, Tauren Chieftans, you name it.\n\nI need you to go take one out. It''ll be a huge blow, not just to their offensive but also to morale.', `VerifiedBuild`=20253 WHERE `Id`=32153; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='$n, what I ask of you is little short of genocide, but it is a task that must be done.\n\nFind trolls within their town or on the beach and slay them, for the good of us all.', `VerifiedBuild`=20253 WHERE `Id`=32200; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mines north of here are being used to extract Ghost Iron ore and energize it with lightning energy.\n\nWe need to destroy the drills they use to extract the ore. They are impervious to normal attack, but can be overloaded using the proper methods.\n\nOh - and while you''re there, take out whoever is running the operation.', `VerifiedBuild`=20253 WHERE `Id`=32208; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The heavy mogu presence in the mines let us know it was a place of great importance - but we needed to gather more information on their activities there, so we sent agents into the mines to spy on them.\n\nUnfortunately, many were captured, and we''ve found that some are being tortured in the mines. You have to go rescue them - nobody deserves what they are going through...\n\nAnd, when you finish, kill whoever captured them. No mercy, $p!', `VerifiedBuild`=20253 WHERE `Id`=32209; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari perform heinous rites against our people! They must be stopped!\n\nDelve into the heart of the Za''Tual and destroy their altars.', `VerifiedBuild`=20253 WHERE `Id`=32215; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari treat their skyscreamer pets as little more than scuttling vermin, bending them to their will with violence and torment.\n\nI can hear one writhing in pain at their hands.\n\nFind the tormented skyscreamer within Za''Tual and help it break free of its captors.', `VerifiedBuild`=20253 WHERE `Id`=32216; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The spirtibinders of the Zandalari perform sacrificial rites to appease the loa and their vile gods. These dark rituals involve the sacrifice of our people.\n\nDestroy any offerings you can find among their tents in Za''Tual and perhaps we can stall the sacrifices.', `VerifiedBuild`=20253 WHERE `Id`=32217; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The creatures the Zandalari ride don''t start out so big, nor do they start out the vicious and loyal creatures they become.\n\nIf you can frighten some of the hatchling skyscreamers away from the beach, perhaps they will have a chance at a real life.', `VerifiedBuild`=20253 WHERE `Id`=32227; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Have you heard of the loa? We do not understand all of what it is, but it seems to be a dark magic with some degree of sentience.\n\nWe do not know what power the loa might possess, but I must ask you to put a stop to their rituals, $c.', `VerifiedBuild`=20253 WHERE `Id`=32252; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari train skyscreamers to become ferocious beasts in the skies. The spiritbinders require endless sacrifices - of our people - to be brought to them. And, the jaguar warriors venture ever closer toward the heart of our camp.\n\nFind them in Za''Tual and remove the threat.', `VerifiedBuild`=20253 WHERE `Id`=32275; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We can use the pterrorwing that you found to strike a decisive blow against the mogu. \n\nTheir mining operation is vulnerable to attack from the air, and your pterrorwing is the only beast we have capable of flying out there.\n\nLet me know when you are ready!', `VerifiedBuild`=20253 WHERE `Id`=32277; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Long ago, Lei Shen found a rare clutch of storm dragon eggs. One of these creatures - Nalak - was particularly brutal, and Lei Shen took it for his own.\n\nThe Thunder King''s servant, Shan Bu, works to resurrect Lei Shen''s dragon, Nalak.\n\nWe must defeat Shan Bu and, if we are able, prevent him from resurrecting the dragon.', `VerifiedBuild`=20253 WHERE `Id`=32279; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You''ve made a good start, but now it''s time to really make a dent in their operations.\n\nTake out Metal Lord Mono-Han,  of the mines.', `VerifiedBuild`=20253 WHERE `Id`=32280; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mogu responsible for the torture of the agents, Fleshcrafter Goju, stands outside the mine.\n\nKilling him would be the only justice for what he''s done to your agents.', `VerifiedBuild`=20253 WHERE `Id`=32281; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The forge lies ahead of you, and with it the heart of the mogu''s weaponsmithing ability.\n\nAnd beyond that, the mogu gatekeeper, who holds the key to unlocking the gate to the next part of the city.\n\nIt''s time to move out!', `VerifiedBuild`=20253 WHERE `Id` IN (32292 /*-Unknown-*/, 32587 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Within the ruins we have identified several powerful mogu artifacts. They trapped spirits within, probably to use them in some ritual or conjuration.\n\nThey are a type of device that we haven''t identified and desperately need to study - they may reveal more of the secrets of the mogu''s spirit binding techniques. \n\nGo, find us a few samples so that we may continue a proper study.', `VerifiedBuild`=20253 WHERE `Id`=32342; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There are two extremely powerful mogu spirits that the Alliance unearthed in their ineptitude.\n\nThese are choice targets for us, $c. If you kill them and collect each of their essences, we could make great progress on decoding the history of this strange ruin.', `VerifiedBuild`=20253 WHERE `Id`=32343; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We have detected several... anomalies in these mines, of an arcane or spiritual nature. They are disrupting our attempts to discern the nature of the magic used in the spirit binding rituals here.\n\nThey are quite elusive, but we''ve managed to isolate the arcane signature of one of these anomalies, and one of our mages has enchanted this bauble with its signature.\n\nTake the bauble. It will begin to glow more brightly as you approach the anomaly. Once you reach it, you can use the bauble to draw it out.', `VerifiedBuild`=20253 WHERE `Id`=32344; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Reliquary may have had a bad name in the past, but we''re not monsters. We simply hold different views about archaeology than the Explorer''s League.\n\nWe do focus on performing acts of heroism from time to time. So go, liberate some of the pandaren slave spirits in the ruins. ', `VerifiedBuild`=20253 WHERE `Id`=32345; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Look. We got a nasty problem here, and ol'' Troteman back at Lion''s Landing''s gonna throw us out of here if we don''t get things under control.\n\nGive us a hand, please!', `VerifiedBuild`=20253 WHERE `Id`=32346; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The bloody Reliquary''s snuck into the ruins. They''ve taken the lower section and are conducting all kinds of magical shenanigans down there.\n\nIt''s time we gave ''em an eviction notice, in the form of your boot in their rear!', `VerifiedBuild`=20253 WHERE `Id`=32347; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Alliance may think they have a stranglehold on the ruins, given that their base of operations is close.\n\nWe''re going to disabuse them of that notion. Go take out some of their guards.', `VerifiedBuild`=20253 WHERE `Id`=32348; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='This sealed communication was sent for you, along with urgent orders to travel to the Valley of Emperors in Kun-Lai Summit.\n\nThis looks serious. I''d not delay if I were you.$B$BSpeak to Tak-Tak for transportation.', `VerifiedBuild`=20253 WHERE `Id`=32376; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='First thing''s first. If we''re going to take the leader captive, we''ll need to thin the numbers of his agents.\n\nBe careful. These mogu are particularly dangerous - they appear to be manipulating the sha in ways we haven''t seen before.', `VerifiedBuild`=20253 WHERE `Id`=32378; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''m not prepared to throw away more of our people fighting against an enemy we don''t know or understand. \n\nSee if you can find any clues in the area as to who exactly these "Korune" mogu are. A contingency in case this operation doesn''t go as planned.', `VerifiedBuild`=20253 WHERE `Id`=32379; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It is time to make our move. Go to the Tomb of Shadows, weaken him, and take him captive.\n\nI will stay here in case Garrosh arrives. He must be delayed so that we can take our prize before he destroys it in his anger.\n\nHurry!', `VerifiedBuild`=20253 WHERE `Id`=32384; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We WILL get to the bottom of this.\n\n$n, you''re coming with me. We''ll search every inch of this city if we have to, but we''ll find out how they took the bell... and where.\n\nI''m picking up traces of arcane magic here... we need to follow the trail!', `VerifiedBuild`=20253 WHERE `Id`=32460; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari Priests in the town to the north prepare the bodies of our fallen allies for sacrifice.\n\nThe best way to prevent this from happening? Kill them. Kill them all.', `VerifiedBuild`=20253 WHERE `Id`=32467; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari Edgetossers to the north are known for becoming fierce Pterodactyl riders and axe throwers. Even now, they train the Pterodactly Hatchlings to become ravenous beasts.\n\nPlease, dispatch of some of the Edgetossers and bring back some of their throwing axes so they cannot be used against us.', `VerifiedBuild`=20253 WHERE `Id`=32468; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Pterodactyl Hatchlings being trained by Zandalari to the north are not yet the violent and savage beasts they are to become.\n\nI believe we should save these creatures before the trolls corrupt them. If you could just frighten them off, perhaps some of them will be spared an unfortunate fate.', `VerifiedBuild`=20253 WHERE `Id` IN (32469 /*-Unknown-*/, 32472 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='While the Zandalari perform live sacrifices, they will not offend their gods by sacrificing a life without also sacrificing offerings of food, treasure, and other items of value.\n\nRecover some of the offerings from cairns in the Troll Town to the north so we might delay their sacrifices further.', `VerifiedBuild`=20253 WHERE `Id`=32470; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Some of the strongest of the spiritbinders perform heinous rites to their wretched gods.\n\nWe''ve devised a method to destroy their altars, so the difficult task will be getting to each altar alive.\n\nVenture into the depths of Za''Tual and destroy their altars.', `VerifiedBuild`=20253 WHERE `Id`=32538; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari''s spiritbinders perform dark sacrifices to appease their gods, killing our people in the process.\n\nDestroy any Zandalari offerings you can find in Za''Tual to help slow the pace of their dark sacrifices.', `VerifiedBuild`=20253 WHERE `Id`=32539; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='If you spend some time in Za''Tual, you will likely see one of their large tents emanating a pure form of evil.\n\nPlease, venture into the troll camp and put a stop to these unspeakable rituals.', `VerifiedBuild`=20253 WHERE `Id`=32540; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It pains me to think of the torture the poor skyscreamers  must endure as the trolls train them to become implements of war.\n\nThe hatchlings are quite fearful, and will fly away if you even get close them. Please, frighten some away before the Zandalari corrupt them.', `VerifiedBuild`=20253 WHERE `Id`=32541; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Zandalari spiritbinders perform sacrifices to their gods, the beastcallers bend innocent skyscreamers to their will, and the jaguar warriors venture closer to us by the day.\n\nDispose of these threats in Za''Tual, $r, and watch the might of the trolls weaken.', `VerifiedBuild`=20253 WHERE `Id`=32542; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Zandalari are a formidable foe - more so than many foes we''ve encountered in the past. But you are a formidable foe as well, $n.\n\nEnter Za''Tual to and show them the risks associated with opposing the likes of you.', `VerifiedBuild`=20253 WHERE `Id`=32543; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='One of the trolls'' skyscreamers in Za''Tual is undergoing a ritual of torture, its will being bent forever to serve its masters.\n\nKill those that inflict such torment on the creature and we can only hope that it will return to the skies.', `VerifiedBuild`=20253 WHERE `Id`=32544; -- -Unknown-
UPDATE `quest_template` SET `RewardMoney`=228000, `RewardBonusMoney`=6150, `VerifiedBuild`=20253 WHERE `Id`=32561; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The mines north of here are critical to the mogu supply line. They are using giant lightning enchanted drills to extract the ore.\n\nIf you can disrupt the drills, they''ll be destroyed, greatly slowing their ability to make weapons.\n\nOh, also, kill whoever is in charge, will you?', `VerifiedBuild`=20253 WHERE `Id`=32586; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Under orders from Jaina herself, some of our agents attempted to sneak past mogu lines to find out what was going on in the mines.\n\nThey were captured, and are being subjected to who-knows-what kind of awful tortures.\n\nYou must free them and kill whoever captured them. We don''t leave anyone behind!', `VerifiedBuild`=20253 WHERE `Id`=32588; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We have a plan to halt the mogu''s weaponmaking capabilities, and it involves the creature you recovered from the Zandalari.\n\nSpeak to me when you''re ready to learn more.', `VerifiedBuild`=20253 WHERE `Id`=32652; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Lei Shen found a clutch of rare storm dragon eggs early in his campaign. One - known as Nalak - was particularly brutal and killed all of its handlers, so he took it for his own.\n\nNow, Shan Bu, one of Lei Shen''s most loyal servants, works to resurrect the dragon.\n\nIt is time for us to strike against Shan Bu!\n\nSpeak to me when you are ready to launch the assault!', `VerifiedBuild`=20253 WHERE `Id`=32656; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The skies call out to you! It''s time to learn to fly!\n\nVisit the flying trainer, Maztha, at the Skyway in Orgrimmar.\n\nAnd don''t forget to buy a flying mount!', `VerifiedBuild`=20253 WHERE `Id`=32674; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The skies call out to you! It''s time to learn to fly!\n\nVisit the flying trainer, Bralla Cloudwing, at the Gryphon Roost in Stormwind.\n\nAnd don''t forget to buy a flying mount!', `VerifiedBuild`=20253 WHERE `Id`=32675; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There''s more you must do. \n\nKill Itoka, master of the forge, and find a codex fragment from Fleshcrafter Hoku, gatekeeper of the Thunder King.', `VerifiedBuild`=20253 WHERE `Id` IN (32723 /*-Unknown-*/, 32910 /*-Unknown-*/);
UPDATE `quest_template` SET `RewardMoney`=228000, `RewardBonusMoney`=6150, `QuestDescription`='There''s more you must do. \n\nKill Itoka, master of the forge, and find a codex fragment from Fleshcrafter Hoku, gatekeeper of the Thunder King.', `VerifiedBuild`=20253 WHERE `Id`=32724; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='<The leather vellum is very old. Stained by age, it bears the following letters:>$B$BOn the isle of time are tall men four\nRound and strong and nothing more\nOf these brothers the shortest be\nWhere the trail leads to me.', `VerifiedBuild`=20253 WHERE `Id`=32974; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='<Another dirty scrap of parchment is buried beneath the soil.>$B$BSomewhere hope stands, wings held forth\nFrom its feet turn to the north\nPass beyond an ancient gate\nBehind a stone pair, I await.', `VerifiedBuild`=20253 WHERE `Id`=32975; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The final step, my treasure calls\nAbove the place where water falls\nBeneath the shade on vantage high\nNo path to walk but air and sky.', `VerifiedBuild`=20253 WHERE `Id`=32976; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Cowardly Thunderlords...\n\nDuring the battle for the citadel, runners informed me that the Iron Wolf is striking at our home. He''ll find no easy footing there, Draka will make them pay tenfold for any of ours that they slay, but we must return quickly and chase the mongrels off.\n\nYou and your forces have proven valuable allies of the Frostwolves. We''d welcome your aid in securing our War''gol.\n\nI''ll see you on the battlefield if you choose to come.', `VerifiedBuild`=20253 WHERE `Id`=33468; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I received a strange object with a note attached. Here, it seems to be written in your tongue, commander.\n\n<Dear Mister Durotan,\n\nI''m Penny... you know, from Azeroth? We met briefly back at $p''s garrison. \n\nAnyway, like I told you, I have a fifth degree black hammer in engineering and I''m eager to serve. The more danger the better!\n\nYou just fire this old flare whenever you''re in trouble and I''ll be there, quick as a quark!\n\nHopefully,\n\nPenny>', `VerifiedBuild`=20253 WHERE `Id`=33593; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Ketya Shrediron,\n\nYour new Iron Shredders are a menace to our own soldiers.\n\nDecommission the prototype and store it in the cave on Talador beach until you''ve worked out the kinks.\n\nI will send Engineer Draxen to work on it in the meantime.\n\n- Orgrim Doomhammer', `VerifiedBuild`=20253 WHERE `Id`=33720; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''ve identified some high value targets down in the forest below.\n\nWhen you get near one, you can deploy my solution.\n\nDeploy it and the objectives will be neutralized with great ceremony.', `VerifiedBuild`=20253 WHERE `Id`=33721; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We must not head into battle prematurely. Before we go after Orgrim, we must first deal with his troops.\n\nIf we are to succeed in our mission of wiping out the Iron Horde from Talador, we need to start on these shores.', `VerifiedBuild`=20253 WHERE `Id`=33722; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The manual for the shredder was wedged in there, but it''s missing lots of pages. We need to find as many pages of that manual as possible and I might--MIGHT--be able to get this shredder operational.\n\nBased on the direction of the wind, I bet the pages flew toward Archenon Siegeyard.', `VerifiedBuild`=20253 WHERE `Id`=33724; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Excellent, excellent! I''ll make sense of these manual pages and will get the Iron Shredder operational immediately!\n\nWhile I do that, take a look through my Eye ''n'' Ear. That''s where you''ll be headed soon!', `VerifiedBuild`=20253 WHERE `Id`=33728; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Iron Shredder is operational! It should be primed and ready for you to shred our enemies in Tuurem!\n\nHead inside and see what damage you can do. Can''t say I''m not jealous.', `VerifiedBuild`=20253 WHERE `Id`=33729; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='To stop the Iron Horde, we must overcome prejudice and work together, if only for this purpose.\n\nHorde, Alliance, past, present... all meaningless in the face of this enemy.\n\nWe will retake Shattrath together... or die trying.', `VerifiedBuild`=20253 WHERE `Id` IN (33731 /*-Unknown-*/, 34099 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='The enemy has explosive devices stored on the beach below. We must recover them so they are not used against us.\n\nReports indicate that crates of explosives are scattered along the shoreline.\n\nWhile you search, Durotan and I will carve deeper into Iron Horde territory.', `VerifiedBuild`=20253 WHERE `Id`=33735; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The orcs themselves are not the only threat. We may have weakened them considerably, but they still have siege weapons of significant power.\n\nSabotage siege weapons you find with the explosives you collected from the beach.', `VerifiedBuild`=20253 WHERE `Id`=33736; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Your allies sent along a goblin, Gazlowe, to advise us against the Iron Horde. Thus far, he has proven a valuable asset.\n\nHe has a looking glass set up that can see a great distance and, he claims, even hear.\n\nUse this looking glass and report back what you''ve seen. I will stick to my standard spyglass.', `VerifiedBuild`=20253 WHERE `Id`=33754; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Want to keep racing, huh? That''s the spirit!\n\nSee if you can beat your best time! Get to the blue post, then green, then red, then back here. \n\nYour time matters, so do it fast!', `VerifiedBuild`=20253 WHERE `Id`=33756; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='[PH] You have saved not only me, but our whole clan from the clutches of the Iron Horde.\n\nYou will find Shamanstones like the one beside me throughout our lands. They will now respond to your touch and you may receive a blessing from them while within Frostfire Ridge.', `VerifiedBuild`=20253 WHERE `Id`=33829; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='These ogres keep takin'' my clan and turnin'' them into slaves!\n\nSlay some ogres and I''ll hold ''em off if they try to run.', `VerifiedBuild`=20253 WHERE `Id`=33898; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The saberon usually keep to themselves, but sometimes they range out of their dens and attack.\n\nA pride of them live in the Windswept Lowland and have been coming too close for comfort, especially at night.\n\nThey even attacked a shipment of axes and took them back to their den!', `VerifiedBuild`=20253 WHERE `Id`=33921; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The current matriarch of the Windswept Lowland saberon pride is bold.\n\nShe leads her pride in ambushes and attacks that some consider organized raids on our supply lines.\n\nThe intelligence she displays  is becoming a legitimate threat.\n\nTake her out and perhaps she''ll be replaced with a less dangerous leader.', `VerifiedBuild`=20253 WHERE `Id`=33924; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I am too far gone to rescue, but thank you for speaking with me.\n\nBlademaster Bralok had his men starve and beat me, and he stole an heirloom that has been in my family since before we arrived on Draenor.\n\nShould you find it, please let me see it once more so I may die in peace.', `VerifiedBuild`=20253 WHERE `Id`=33973; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='An ally of yours, Thaelin, is helping us counter the Iron Horde.\n\nHe claims this device can be used to spy on the enemy, even so far as hearing what they are saying at great distance.\n\nI do not trust such devices. Use it and let me know what you see.', `VerifiedBuild`=20253 WHERE `Id`=34087; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We must slay the Iron Horde troops who infest our lands.\n\nFind those who would sully our great forest and show them the hand of justice.', `VerifiedBuild`=20253 WHERE `Id`=34088; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Iron Horde has explosive devices stored throughout the heart of their logging camp.\n\nWe must recover them so they are not used against us.\n\nI will keep an eye on Maraad... I worry for him in his anger.', `VerifiedBuild`=20253 WHERE `Id`=34089; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Those orcs sure like to pile things up in one place. That gave me an idea...\n\nI''ve built this ingenious device for ya! When you get near a target, it''ll let you know, and you can deploy it for a big, satisfying, kerBOOM!', `VerifiedBuild`=20253 WHERE `Id`=34090; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Ketya Shrediron,\n\nYour new Iron Shredders are a menace to our own soldiers.\n\nDecommission the prototype and store it out of the way until you''ve worked out the kinks.\n\nI will send Engineer Trak to work on it in the meantime.\n\n- Orgrim Doomhammer', `VerifiedBuild`=20253 WHERE `Id`=34091; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='That shredder had a manual jammed in the cockpit, but it''s missing a lot o'' pages. If we can find those manual pages, I''d bet my third toe I can get the prototype shredder working again.\n\nI coulda swore I saw a few of those pages floatin'' about in  Archenon Siegeyard. Maybe the orcs there carry them.', `VerifiedBuild`=20253 WHERE `Id`=34094; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The orcs themselves are not the only threat. They still have siege weapons of significant power.\n\nThey''ve already been used against Tuurem, and we must not allow for their continued operation.\n\nSabotage siege weapons using the explosives you collected from the logging camp.', `VerifiedBuild`=20253 WHERE `Id`=34095; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''ll get the prototype shredder working right now!\n\nTake a look through my Observicopter. You''ll see what you''re about to head into...', `VerifiedBuild`=20253 WHERE `Id`=34096; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''ve got this prototype shredder operating on most cylinders.\n\nBoy, will they be surprised when you stomp them with their own machine!\n\nCan''t wait to watch you from the safety of the Observicopter.', `VerifiedBuild`=20253 WHERE `Id`=34097; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Without you, none of us would have made it to the shores of my homeland. You will be the one to lead our forces here on Draenor. This is your garrison to found.\n\nI leave it to you to plant the banner and claim this territory. When you are ready, I will have Khadgar open a portal to bring through a few necessary reinforcements.', `VerifiedBuild`=20253 WHERE `Id`=34364; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Alright, boss. We''re gonna need some lumber if we''re gonna get this garrison started off right.\n\nIf you mark some trees to be cut down, your peons will do the rest.', `VerifiedBuild`=20253 WHERE `Id`=34375; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Okay, commander, here''s the deal. You''re gonna want spikes and all sorts of cool stuff on your garrison, right? To get started, we''ll need some ore from a nearby cave.\n\nCheck out that cave to the southeast of us. Knowing what I know from being here for a no time at all, I bet there''s something big and nasty inside.\n\nTake care of it and the peons will get the ore for ya.', `VerifiedBuild`=20253 WHERE `Id`=34376; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The return of many of my people is a boon to us, and I thank you for your part in their survival.\n\nCome, ride with me. We have much to discuss.', `VerifiedBuild`=20253 WHERE `Id`=34402; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='You are going to want to build your barracks, which you''re gonna need to properly bash faces.\n\nThe first step is to go find the blueprints and learn ''em. I think I left some blueprints lying around here somewhere.\n\nNext ya gotta pick which plot you want us to build it on. Just point it out on my architect table and we''ll get started constructing that thing right away.', `VerifiedBuild`=20253 WHERE `Id`=34461; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Testing Instructions\n\ncgo 230284\n\nLoot items until objective is complete\n\nYou should see an explosion visual', `VerifiedBuild`=20253 WHERE `Id`=34589; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='It''s gonna be quite a task to build you a fortress if there''s gronnlings rampaging around.\n\nI don''t think anyone else here can handle taking those big beasts out, so you might need to take care of it yourself.', `VerifiedBuild`=20253 WHERE `Id`=34592; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Our shadow hunters spotted some of dem Thunderlord gettin'' ready to attack us, commanda!\n\nWe should be gettin'' ready for an invasion!', `VerifiedBuild`=20253 WHERE `Id`=34650; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='**Eyes Only -- Commander $n**\n\nWith the fall of the rangari base at Telaar, Vindicator Yrel, recommended we establish a new foothold in Nagrand.\n\nI''ve taken the liberty of dispatching some of our men and supplies. Rangari D''kaan''s already reporting that a new outpost is nearly complete. He has indicated that they are ready to receive you.\n\nA gryphon is waiting to catch you up with the latest caravan shipment whenever you''re ready, $g sir:ma''am;.\n\n-- Bodrick Grey, SI:7', `VerifiedBuild`=20253 WHERE `Id`=34674; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='These outcasts are not the only cursed arakkoa holding their ground in Arak.\n\nA curious cult has formed in worship of Ka''alu, my consort and the keeper of my brood. They are considered to be quite... odd.\n\nRegardless, the outcasts will need their help. Without the wings of the ravens, Iskar can never take his fight to the spires.\n\nTake this feather and place it in the offering basket south of here. The so-called "Ravenspeakers" will surely take notice.', `VerifiedBuild`=20253 WHERE `Id`=34921; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Hey! I hear there''s a curious object nearby. Scouts say it''s some kind of shredder manual.\n\nGo check it out for me, will ya? I wonder if it has to do with this new prototype I''ve been hearin'' about...', `VerifiedBuild`=20253 WHERE `Id`=34947; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I''ve been hearing rumors of this new prototype shredder the Iron Horde''s engineers have been working on.\n\nI think we ought to investigate. A shadow hunter spotted some sort of shredder manual, and it might have something to do with that prototype.', `VerifiedBuild`=20253 WHERE `Id`=34948; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Nearby, a group of Iron Horde took over a key strategic position with surprising alacrity.\n\nThey used a machine they call Dreadpiston to terrible effect in the siege, and I believe we need to destroy that machine before moving against the Iron Horde in Tuurem.', `VerifiedBuild`=20253 WHERE `Id`=34950; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Iron Horde overtook a peaceful draenei outpost without mercy.\n\nThey used a machine they call Dreadpiston to level the town in minutes.\n\nDestroy it.', `VerifiedBuild`=20253 WHERE `Id`=34959; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We have the Iron Horde backed into a corner now, thanks to you.\n\nIt is almost time to enter the city of Shattrath and repel them.\n\nFirst, we must meet Khadgar and some new allies.', `VerifiedBuild`=20253 WHERE `Id`=34962; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='Shattrath must not fall into the hands of the Iron Horde. It is time again for me to get my hands bloody.\n\nWe will tell Khadgar we are ready to enter the city and take back what is rightfully ours.', `VerifiedBuild`=20253 WHERE `Id`=34963; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I cannot believe Orgrim would continue to do Blackhand''s bidding after all the destruction he has wrought.\n\nWe must confront him. Join me at the village along Orunai Coast and we will confront my oldest friend.', `VerifiedBuild`=20253 WHERE `Id`=35226; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The sacking of this fortress is as much your victory as ours. It is only fair you should share in the bounty.\n\nI had the men prepare a chest for you. Take what you will.', `VerifiedBuild`=20253 WHERE `Id`=35251; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='I found this dwarf, Thuldren, runnin'' out of Tangleheart like his boots were on fire.\n\nSays his mole machine showed up here and he barely made it out alive. And another called Frenna might still be inside.\n\nOne useful thing he told me is that the creatures in there have sap that can be used to grow things real fast.\n\nBy the way, I''m gonna go lookin'' for Thuldren''s mole machine. Find me in Tangleheart when you''re done.', `VerifiedBuild`=20253 WHERE `Id`=35506; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='There are strange, glowing objects within Tangleheart, seemingly pollinated by a variety of stinging creature.\n\nThe botani sometimes collect whatever the pods produce. I can''t be sure what it is, but it might be dangerous to us.\n\n- Frenna', `VerifiedBuild`=20253 WHERE `Id` IN (35508 /*-Unknown-*/, 35654 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='I have seen a strange ritual performed by ancients. They step into fire, burning the leaves from their branches and charring their bark.\n\nI call it the Ritual of the Charred. If we want to weaken the ancients, we can get rid of them before they become even stronger.\n\n- Frenna', `VerifiedBuild`=20253 WHERE `Id` IN (35524 /*-Unknown-*/, 35650 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='I have seen a creature working with the ancient saplings, imbuing them with anger and hatred toward creatures unlike them.\n\nPerhaps it is this botani who is responsible for the unusually aggressive nature of ancients here in Tangleheart.\n\nWould killing this botani do us good? I fear I would be no match for it alone.\n\n- Frenna', `VerifiedBuild`=20253 WHERE `Id` IN (35527 /*-Unknown-*/, 35651 /*-Unknown-*/);
UPDATE `quest_template` SET `QuestDescription`='Commander, scouts from Spires of Arak have brought back news to the garrison. There''s word of a brewin'' war between bird-men and the Shattered Hand orcs.\n\nRokhan''s askin'' for your presence when your work is done here, should ya be willin'' sir.', `VerifiedBuild`=20253 WHERE `Id`=35537; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='While you were gone, a rather shady looking human arrived at the outpost asking for you. He said he worked for... Grey was it?... and had some information regarding Spires of Arak that you would be interested in.\n\nHe was heading back to your garrison and asked that I passed along the message, and so I have.\n\nAnd before you go, thank you for all you''ve done for us here, truly. You and your army have turned the tides of a war that you could have just as easily walked away from. We will not forget.', `VerifiedBuild`=20253 WHERE `Id`=35554; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='We got the lumber mill good an'' built, but we be needin'' more wood!\n\nThe Rangari tol'' me there''s botani usin'' some kinda sap to grow ancients fast as you like.\n\nGet yer hands on some o'' that sap and I betcha I can put it work.\n\nWhat? Oh, Glyza here? Found ''er crashed here and she knows a thing or two about lumberjackin''. I''ll take her back to the outpost later.\n\nI''ll meet ya inside Tangleheart if I can find it.', `VerifiedBuild`=20253 WHERE `Id`=35652; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='The Rangari have been here for a tick, and they hear tell from the Laughing Skull o'' a place called Tangleheart.\n\nSeems some really bad ancients come from there, and botani use a kind o'' sap to grow them quickly.\n\nI think we could use that for yer outpost. Hey, wood is wood, right?\n\nI''ll meet ya there.', `VerifiedBuild`=20253 WHERE `Id`=35708; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='That gavel was once known as Beakbreaker. In his final, darkest days, Terokk used it to perform grim, damnable acts of sacrifice. \n\nIt is best not to dwell on those days.\n\nTerokk was sealed away deep within the shadows to rest, and perhaps to heal.\n\nMaking contact with him will take a great deal of effort, so in the meantime, allow me to tell you of his more glorious exploits. Before this wretched curse took hold.\n\nPlease, place the gavel upon the effigy.', `VerifiedBuild`=20253 WHERE `Id`=35733; -- -Unknown-
UPDATE `quest_template` SET `QuestDescription`='<As Reshad begins reciting a tale of Terokk''s glory days, your eyes fall to the twin swords at the effigy''s belt.\n\nThey had seemed so plain in Skettis, but now they thrum with power, as if reacting to the scrollkeeper''s words.>', `VerifiedBuild`=20253 WHERE `Id`=35734; -- -Unknown-


